INSERT INTO `book` VALUES (2, NULL, NULL, 'admin', '2023-11-28 23:01:47', 'Thought Catalog', 74000, '<p>Nếu được nhận 1 l&aacute; thư bất kỳ th&igrave; bạn sẽ muốn nhận l&aacute; thư như thế n&agrave;o?</p>\n<p>Đ&oacute; l&agrave; l&aacute; thư từ người m&agrave; bạn y&ecirc;u qu&yacute;, từ gia đ&igrave;nh của bạn, từ một người m&agrave; bạn đ&atilde; bỏ lỡ hay từ ch&iacute;nh bản th&acirc;n m&igrave;nh trong tương lai?</p>\n<p><strong>&ldquo;</strong><em><strong>L&aacute; thư gửi từ miền hạnh ph&uacute;c&rdquo;</strong>&nbsp;l</em>&agrave; cuốn s&aacute;ch chứa đựng tất cả những điều ngọt ng&agrave;o m&agrave; bạn mong đợi v&agrave; t&igrave;m kiếm.</p>\n<p>Bạn t&igrave;m thấy trong đ&oacute; những lời động vi&ecirc;n để vượt qua kh&oacute; khăn, t&igrave;m thấy những lời an ủi trong gi&acirc;y ph&uacute;t tuyệt vọng, t&igrave;m thấy những lời nhắn nhủ để y&ecirc;u m&igrave;nh y&ecirc;u đời, t&igrave;m thấy những dịu d&agrave;ng giữa cuộc sống bận rộn v&agrave; x&ocirc; bồ n&agrave;y&hellip;</p>\n<p>Đ&acirc;y tựa như một cuốn nhật k&yacute; nhỏ hạnh ph&uacute;c, để d&ugrave; bạn lật giở trang s&aacute;ch n&agrave;o n&oacute; cũng nhắc bạn nhớ về những điều dễ thương c&ograve;n hiện diện trong cuộc đời của m&igrave;nh.</p>\n<p>* <strong>Thought Catalog</strong> l&agrave; một nh&oacute;m t&aacute;c giả nổi tiếng tại Mỹ, năm 2022 Thought Catalog đ&atilde; xuất hiện tr&ecirc;n kệ s&aacute;ch của mọi nh&agrave; với ấn phẩm nổi bật &ldquo;Điều đẹp nhất c&oacute; khi l&agrave; bu&ocirc;ng tay&rdquo;. Tiếp nối h&agrave;nh tr&igrave;nh l&agrave;m l&ecirc;n những điều diệu kỳ, cuốn s&aacute;ch &ldquo;L&aacute; thư gửi từ miền hạnh ph&uacute;c&rdquo; sẽ l&agrave; kim chỉ nam dẫn bạn đến những nơi tuyệt vời hơn, đẹp đẽ hơn.</p>', '4f1e9095b17d40a28fabc326a9c9caf5.jpg', 'Lá Thư Gửi Từ Miền Hạnh Phúc', 88000, 44, 15, 12, 0);
INSERT INTO `book` VALUES (3, NULL, NULL, 'admin', '2023-11-27 22:24:00', 'Holly Jackson', 143500, '<p><em>&ldquo;80% người mất t&iacute;ch được t&igrave;m thấy trong 24 tiếng đầu ti&ecirc;n.</em></p>\n<p><em>97% được t&igrave;m thấy trong tuần đầu ti&ecirc;n.</em></p>\n<p><em>99% vụ việc được giải quyết trong năm đầu ti&ecirc;n, nghĩa l&agrave; chỉ c&oacute; 1% số người mất t&iacute;ch kh&ocirc;ng được t&igrave;m thấy.</em></p>\n<p><em>Chỉ c&oacute; 0.25% tất cả c&aacute;c trường hợp mất t&iacute;ch dẫn đến kết quả thiệt mạng.</em></p>\n<p><em>V&agrave; số liệu n&agrave;y n&oacute;i g&igrave; về trường hợp của Andie Bell?&rdquo;</em></p>\n<p>Vụ &aacute;n Andie Bell/ Sal Singh đ&atilde; kh&eacute;p lại được 5 năm. Thời điểm đ&oacute;, cảnh s&aacute;t kết luận rằng Sal - bạn trai của Andie - ch&iacute;nh l&agrave; hung thủ s&aacute;t hại bạn g&aacute;i rồi tự s&aacute;t. Mặc d&ugrave; Sal chưa từng c&oacute; cơ hội tự b&agrave;o chữa, anh ấy vẫn c&oacute; tội. Mặc d&ugrave; thi thể của Andie chưa được t&igrave;m ra, mọi người vẫn mặc định c&ocirc; ấy đ&atilde; chết.</p>\n<p>&ldquo;<em>Kh&ocirc;ng c&oacute; cụm từ &ldquo;được cho rằng&rdquo;, &ldquo;c&oacute; thể&rdquo;, &ldquo;dường như&rdquo; hay &ldquo;hẳn l&agrave;&rdquo; n&agrave;o cả.</em></p>\n<p><em>&ldquo;Sal Singh đ&atilde; giết Andie&rdquo;, họ n&oacute;i vậy. Nhưng t&ocirc;i kh&ocirc;ng qu&aacute; chắc chắn về điều đ&oacute;&hellip;&rdquo;</em></p>\n<p>Pippa - một c&ocirc; nữ sinh trung học giỏi giang, th&ocirc;ng minh - tin rằng hung thủ thật sự của vụ &aacute;n năm xưa vẫn c&ograve;n ẩn nấp trong b&oacute;ng tối. C&ocirc; quyết định &ldquo;lật lại vụ &aacute;n&rdquo; v&agrave; bắt tay với Ravi - em trai Sal - nhằm chứng minh những g&igrave; m&igrave;nh tin l&agrave; đ&uacute;ng v&agrave; tr&ecirc;n tất cả l&agrave; t&igrave;m lại danh dự cho Sal. Dưới &ldquo;b&oacute;ng &ocirc;&rdquo; của một dự &aacute;n cấp trường, Pippa đ&atilde; phỏng vấn tất cả những người li&ecirc;n quan tại thời điểm ấy h&ograve;ng t&igrave;m ra một lỗ hổng, một sự lật trở d&ugrave; l&agrave; nhỏ nhất giữa những c&acirc;u trả lời. C&ugrave;ng với Ravi, họ dần d&agrave; b&oacute;c t&aacute;ch từng tầng từng lớp nh&acirc;n c&aacute;ch phức tạp của &ldquo;nạn nh&acirc;n hồng nhan bạc phận&rdquo; Andie Bell v&agrave; l&agrave;m r&otilde; những &ldquo;sự thật đổi trắng thay đen&rdquo; từ c&aacute;c manh mối x&aacute;c đ&aacute;ng thu thập được. Đ&oacute; l&agrave; khi những lời đe dọa ẩn danh xuất hiện ng&agrave;y một nhiều v&agrave; trắng trợn, gi&aacute;n tiếp đặt Pippa v&agrave;o t&igrave;nh thế &ldquo;một mất một c&ograve;n&rdquo;.</p>', '847717bc8ac14bfcb648d4265bcdfc60.jpg', 'Nhân Chứng Cuối Cùng', 169000, 40, 15, 12, 0);
INSERT INTO `book` VALUES (4, 'admin', '2023-11-27 22:35:41', 'admin', '2023-11-27 22:35:41', 'Nhiều tác giả', 74500, '<p>Ta thiết tha với đời khi t&igrave;m thấy một l&yacute; do để mỗi ng&agrave;y thức dậy!</p>\n<p>Ch&uacute;ng ta đều mong muốn sống một cuộc đời hạnh ph&uacute;c, b&igrave;nh an v&agrave; c&oacute; &yacute; nghĩa. V&agrave; một đời như thế, thực ra ch&iacute;nh l&agrave; tập hợp của mỗi ng&agrave;y hạnh ph&uacute;c, m&agrave; ta c&oacute; thể t&oacute;m gọn bằng t&aacute;m chữ &ldquo;th&acirc;n c&oacute; sức lực, tim c&oacute; động lực&rdquo;. Tất cả bắt đầu từ khoảnh khắc tỉnh giấc, khi nhận ra m&igrave;nh vẫn c&ograve;n hơi thở, c&oacute; đủ sức lực để bước ra khỏi giường v&agrave; tự chăm s&oacute;c bản th&acirc;n; c&oacute; động lực để tiếp tục kh&aacute;m ph&aacute; cuộc sống n&agrave;y v&agrave; ki&ecirc;n tr&igrave; thực hiện ước mơ của m&igrave;nh.</p>\n<p>Ai cũng đang c&oacute; một quỹ động lực vừa đủ để duy tr&igrave; cuộc sống. Nhưng kh&ocirc;ng phải l&uacute;c n&agrave;o bạn cũng tr&agrave;n trề nhiệt huyết v&agrave; đủ mạnh mẽ để tự tạo ra động lực, cũng kh&ocirc;ng phải l&uacute;c n&agrave;o sự cố gắng của bạn cũng được c&ocirc;ng nhận. Ch&uacute;ng ta đều l&agrave; những người b&igrave;nh thường cần giao tiếp x&atilde; hội v&agrave; trao đổi năng lượng để ph&aacute;t triển. Vậy n&ecirc;n những l&uacute;c bạn cảm thấy chơi vơi, hy vọng &ldquo;Ch&agrave;o ng&agrave;y mới, ch&uacute;c b&igrave;nh an&rdquo; sẽ trở th&agrave;nh một trạm sạc năng lượng, l&agrave; nơi tiếp th&ecirc;m một ch&uacute;t động lực nhỏ b&eacute; để bạn tha thiết với cuộc sống n&agrave;y hơn.</p>\n<p>Con người trưởng th&agrave;nh theo quy luật &ldquo;th&agrave;nh, trụ, hoại, diệt&rdquo;, cũng như trời đất xoay vần theo bốn m&ugrave;a &ldquo;xu&acirc;n, hạ, thu, đ&ocirc;ng&rdquo;.&ldquo;Ch&agrave;o ng&agrave;y mới, ch&uacute;c b&igrave;nh an&rdquo; ch&iacute;nh l&agrave; tập hợp những b&agrave;i viết từ Tủ S&aacute;ch Chữa L&agrave;nh về h&agrave;nh tr&igrave;nh trưởng th&agrave;nh trong cảm x&uacute;c, như một v&ograve;ng xoay thời gian theo bốn m&ugrave;a:</p>\n<p>- Xu&acirc;n c&oacute; hoa cỏ: l&agrave; nốt hương đầu dịu d&agrave;ng, với những c&acirc;u chuyện về c&aacute;i đẹp trong cuộc sống, sự tử tế của con người, sự trưởng th&agrave;nh trong nội t&acirc;m,... như mang đến một b&oacute; hoa m&ugrave;a xu&acirc;n để ng&ocirc;i nh&agrave; t&acirc;m hồn c&oacute; th&ecirc;m hương sắc.</p>\n<p>- Hạ c&oacute; biển xanh: l&agrave; nốt hương giữa tươi trẻ, với những b&agrave;i viết truyền cảm hứng về lối sống, c&ocirc;ng việc, c&aacute;c mối quan hệ, để ch&uacute;ng ta dũng cảm tiến nơi c&oacute; &aacute;nh s&aacute;ng, lưu lại một giai thoại nồng nhiệt, rực rỡ như m&ugrave;a h&egrave;!</p>\n<p>- Thu c&oacute; tr&agrave; mạn: một nốt trầm suy tư về con người, cuộc sống, những chuyện đ&atilde; v&agrave; đang diễn ra, để ta nh&igrave;n thời thế m&agrave; hiểu ch&iacute;nh m&igrave;nh.</p>\n<p>- Đ&ocirc;ng c&oacute; bạn hiền: l&agrave; nốt hương cuối lưu lại nhiều cảm x&uacute;c, vừa kh&eacute;p lại một chặng đường, vừa mở ra một ch&acirc;n trời mới.</p>\n<p>V&agrave;o những l&uacute;c bạn cảm thấy chơi vơi, hy vọng &ldquo;Ch&agrave;o ng&agrave;y mới, ch&uacute;c b&igrave;nh an&rdquo; trở th&agrave;nh một trạm sạc năng lượng, l&agrave; nơi tiếp th&ecirc;m một ch&uacute;t động lực nhỏ b&eacute; để bạn tha thiết với cuộc sống n&agrave;y hơn.</p>\n<p>Ch&uacute;c bạn mỗi ng&agrave;y &ldquo;th&acirc;n c&oacute; sức lực, tim c&oacute; động lực&rdquo;.</p>', 'a6f4324468a84b3ea5c389b95a457157.jpg', 'Chào Ngày Mới - Chúc Bình An', 88000, 50, 15, 11, 0);
INSERT INTO `book` VALUES (5, 'admin', '2023-11-27 22:38:38', 'admin', '2023-11-27 22:38:38', 'Annet Schaap', 134000, '<p><strong>T&Aacute;C PHẨM PHI&Ecirc;U LƯU NHUỐM ĐẦY M&Agrave;U SẮC CỔ T&Iacute;CH!</strong></p>\n<p>Gọi c&ocirc; l&agrave; Đ&egrave;n Nhỏ v&igrave; c&ocirc; l&agrave; con g&aacute;i người thắp đ&egrave;n biển. Nhưng ch&iacute;nh c&ocirc; g&aacute;i nhỏ lơ đễnh m&agrave; nh&acirc;n hậu, ki&ecirc;n cường ấy mới l&agrave; người chiều chiều, thay người cha qu&egrave; cụt say xỉn, leo l&ecirc;n thắp s&aacute;ng ngọn hải đăng.</p>\n<p>Cho đến một ng&agrave;y, Đ&egrave;n qu&ecirc;n mua di&ecirc;m. Hải đăng tắt ng&uacute;m. Thảm họa ập v&agrave;o.</p>\n<p>N&agrave;ng ti&ecirc;n c&aacute; đ&aacute;nh đổi giọng h&aacute;t để được sống với người m&igrave;nh y&ecirc;u, c&aacute;nh cửa cấm kỵ trong dinh thự trăm ph&ograve;ng, qu&aacute;i vật dưới gầm giường, những dị nh&acirc;n hội chợ, những cướp biển ngang t&agrave;n, những thủy qu&aacute;i khơi xa,&hellip; Cổ t&iacute;ch cứ thế đan dệt, như ngọn gi&oacute; đại dương k&eacute;o ta băng băng qua những trang phi&ecirc;u lưu kỳ dị m&agrave; bay bổng, u tối m&agrave; ấm l&ograve;ng. Một c&acirc;u chuyện m&ecirc; đắm về l&ograve;ng can đảm, sự trung th&agrave;nh, về t&igrave;nh cảm gia đ&igrave;nh v&agrave; t&igrave;nh bạn bất chấp kh&aacute;c biệt. Một bầu kh&ocirc;ng kh&iacute; mầu nhiệm m&agrave; ta muốn k&eacute;o d&agrave;i m&atilde;i m&atilde;i.</p>', '05b374f90c7b415aa8704f0176424e2d.jpg', 'Đèn Nhỏ Và Những Đứa Con Của Biển', 158000, 50, 15, 12, 0);
INSERT INTO `book` VALUES (6, 'admin', '2023-11-27 22:41:40', 'admin', '2023-11-27 22:41:40', 'Ta Pi', 75000, '<p>Bạn c&oacute; biết đ&aacute;ng buồn hơn cả việc thổ lộ rồi bị từ chối đ&oacute; l&agrave; g&igrave; kh&ocirc;ng?</p>\n<p>Đ&oacute; l&agrave; &ocirc;m nỗi l&ograve;ng của m&igrave;nh hết ng&agrave;y n&agrave;y qua th&aacute;ng kh&aacute;c, b&agrave;y tỏ th&igrave; sợ thất bại, kh&ocirc;ng b&agrave;y tỏ th&igrave; bứt rứt kh&ocirc;ng y&ecirc;n. Vậy l&agrave; cứ thế một m&igrave;nh tự gặm nhấm hạnh ph&uacute;c, khổ đau, tự d&agrave;y v&ograve; bản th&acirc;n m&atilde;i kh&ocirc;ng chịu bu&ocirc;ng.</p>', '799e0549236f4ab38d4fd0db77c753d7.jpg', 'Lời Chưa Nói', 100000, 55, 25, 12, 0);
INSERT INTO `book` VALUES (7, 'admin', '2023-11-27 22:44:13', 'admin', '2023-11-27 22:44:13', 'Stanislas', 81500, '<p>Trước ng&ocirc;i nh&agrave; số 15 phố Rackham, bốn người đ&agrave;n &ocirc;ng v&acirc;y quanh một khối đen nằm tr&ecirc;n vỉa h&egrave;. Khối đen đ&oacute; ch&iacute;nh l&agrave; thi thể của một người đ&agrave;n &ocirc;ng với hộp sọ n&aacute;t bấy, chết bất đắc kỳ tử. H&agrave;ng loạt những vụ &aacute;.n li&ecirc;n ho&agrave;n kh&ocirc;ng t&igrave;m ra lời giải. Hung thủ lu&ocirc;n để lại dấu vết v&agrave; tự xưng l&agrave; ng&agrave;i Smith. Người ta đồn rằng, g&atilde; đang ẩn n&aacute;u tại nh&agrave; trọ Victoria 21.</p>\n<p>Khi Sở cảnh s&aacute;t tự tin rằng họ đ&atilde; bắt được hung thủ th&igrave; kỳ lạ thay, những c&aacute;i chết vẫn kh&ocirc;ng ngừng tiếp diễn&hellip;</p>', 'bd8ffe76160f492e91051a72f9efcdc6.jpg', 'Kẻ Sát Nhân Ở Số Nhà 21', 96000, 42, 15, 12, 0);
INSERT INTO `book` VALUES (8, 'admin', '2023-11-27 22:45:52', 'admin', '2023-11-27 22:45:52', 'Miêu Công Tử', 279000, '<p>Ra mắt lần đầu năm 2018 với sứ mệnh mang đến cảm hứng sống t&iacute;ch cực v&agrave; nguồn năng lượng tươi m&aacute;t đến c&aacute;c độc giả, &ldquo;999 l&aacute; thư gửi cho ch&iacute;nh m&igrave;nh&rdquo; của t&aacute;c giả Mi&ecirc;u C&ocirc;ng Tử đ&atilde; nhận được sự ch&agrave;o đ&oacute;n v&ocirc; c&ugrave;ng nhiệt t&igrave;nh bới những l&aacute; thư mang th&ocirc;ng điệp v&agrave; &yacute; nghĩa hết sức s&acirc;u sắc, tiếp sức gi&uacute;p mọi người ng&agrave;y một nỗ lực hơn để c&oacute; thể vững bước tr&ecirc;n con đường th&agrave;nh c&ocirc;ng v&agrave; khẳng định bản th&acirc;n.</p>\n<p>Giờ đ&acirc;y, nhằm đ&aacute;p ứng nhu cầu của những độc giả c&oacute; niềm y&ecirc;u th&iacute;ch ng&ocirc;n ngữ Trung Quốc, Vanvietbooks h&acirc;n hạnh ra mắt &ldquo;999 l&aacute; thư gửi cho ch&iacute;nh m&igrave;nh&rdquo; &ndash; Phi&ecirc;n bản Song ngữ to&agrave;n tập với đầy đủ 999 l&aacute; thư chỉ trong 1 cuốn s&aacute;ch duy nhất! Được lấy cảm hứng từ chiếc tủ s&aacute;ch &ndash; tượng trưng cho nguồn kiến thức dồi d&agrave;o, mới lạ đang chờ đ&oacute;n bạn khai ph&aacute; - từng trang s&aacute;ch ch&iacute;nh l&agrave; từng &ocirc; tủ chứa đựng những l&aacute; thư th&acirc;n quen kh&ocirc;ng chỉ mang t&iacute;nh truyền cảm hứng sống m&agrave; c&ograve;n &ldquo;đ&iacute;nh k&egrave;m&rdquo; cả H&aacute;n tự v&agrave; phi&ecirc;n &acirc;m được tr&igrave;nh b&agrave;y khoa học, hợp l&yacute; v&agrave; đẹp mắt, l&agrave; một c&ocirc;ng cụ rất tốt để gi&uacute;p bạn đọc r&egrave;n luyện v&agrave; n&acirc;ng cao khả năng ngoại ngữ, trau dồi kiến thức, đ&uacute;ng với ti&ecirc;u ch&iacute; gi&uacute;p bạn trở th&agrave;nh phi&ecirc;n bản ho&agrave;n hảo nhất của ch&iacute;nh m&igrave;nh.</p>', 'eaf9d1d1aebe44568bd166ca545c8d53.jpg', '999 Lá Thư Gửi Cho Chính Mình - Song Ngữ Trung-Việt Có Phiên Âm (Toàn Tập)', 349000, 42, 20, 12, 0);
INSERT INTO `book` VALUES (9, 'admin', '2023-11-27 22:47:13', 'admin', '2023-11-27 22:47:14', 'Nicolas', 279000, '<p>Một chiều h&egrave; oi ả năm 1992, tại v&ugrave;ng thung lũng hẻo l&aacute;nh nằm đ&acirc;u đ&oacute; ph&iacute;a đ&ocirc;ng nước Ph&aacute;p, b&ecirc;n hồ nước tĩnh lặng, Anthony, 14 tuổi, c&ugrave;ng người anh họ quyết định đ&aacute;nh cắp chiếc thuyền kayak để ch&egrave;o sang bờ b&ecirc;n kia nơi c&oacute; b&atilde;i tắm khỏa th&acirc;n trứ danh. Tại đ&acirc;y, cậu thiếu ni&ecirc;n lần đầu rơi v&agrave;o lưới t&igrave;nh với con g&aacute;i của ứng cử vi&ecirc;n chức thị trưởng. Khởi nguồn từ mối t&igrave;nh đơn phương n&agrave;y, tuổi thanh xu&acirc;n đầy biến động của Anthony bắt đầu.</p>\n<p>Bốn m&ugrave;a h&egrave; trải d&agrave;i từ những giai diệu của Nirvana v&agrave; Johnny Hallyday đến chiến thắng của tuyển Ph&aacute;p tại kỳ World Cup 1998, cuốn s&aacute;ch t&aacute;i hiện những khung cảnh đầy ho&agrave;i niệm v&agrave; đồng điệu s&acirc;u sắc với cả một thế hệ lớn l&ecirc;n trong thập ni&ecirc;n ch&iacute;n mươi. Qua c&acirc;u chuyện về những mảnh đời nhỏ b&eacute; nơi thị x&atilde; Heillange, Nicolas Mathieu kh&ocirc;ng chỉ viết n&ecirc;n cuốn tiểu thuyết về một thung lũng, một thanh xu&acirc;n l&atilde;ng mạn m&agrave; về cả một đất nước, một thời kỳ v&agrave; một lớp người trẻ đang đi t&igrave;m con đường cho cuộc đời m&igrave;nh giữa một thế giới lụi t&agrave;n.</p>\n<p>Cuốn s&aacute;ch l&agrave; số phận của những con người bị hủy hoại trước sự đối lập giữa hy vọng v&agrave; hiện thực, nơi xứ sở c&aacute;ch xa qu&aacute; tr&igrave;nh to&agrave;n cầu h&oacute;a, mắc kẹt giữa nỗi tiếc thương v&agrave; sự sụp đổ. Giống như nhan đề Con ch&aacute;u của họ cũng thế th&ocirc;i, liệu họ c&oacute; thể tho&aacute;t khỏi v&ograve;ng quay số phận v&agrave; kh&ocirc;ng lao v&agrave;o con đường cha mẹ họ từng đi?</p>', '173e124fe5a94b848bd1c82616d68a59.jpg', 'Con Cháu Của Họ Cũng Thế Thôi', 349000, 40, 20, 12, 0);
INSERT INTO `book` VALUES (10, NULL, NULL, 'admin', '2023-11-27 22:53:30', 'Otsuichi', 109500, '<p><strong>Danielle</strong>&nbsp;l&agrave; một &ldquo;mọt phim&rdquo; ch&iacute;nh hiệu, c&ocirc; n&agrave;ng say m&ecirc; những bộ phim giả tưởng, đặc biệt l&agrave; x&ecirc;-ri phim huyền thoại Starfield. Sở th&iacute;ch n&agrave;y gắn với v&ugrave;ng k&iacute; ức tuổi thơ tươi s&aacute;ng nhất của Danielle, khi c&ocirc; c&ograve;n c&oacute; bố mẹ b&ecirc;n m&igrave;nh, chưa phải đối diện với cuộc sống thực tại ngột ngạt, bị mẹ kế c&ugrave;ng hai người chị song sinh đối xử t&agrave;n tệ. Cơ hội d&agrave;nh cho Danielle cuối c&ugrave;ng cũng đến, Cuộc thi cosplay c&aacute;c nh&acirc;n vật trong Starfield với giải thưởng l&agrave; một chuyến đi tới L.A c&oacute; thể l&agrave; tấm v&eacute; đưa c&ocirc; tho&aacute;t khỏi nơi n&agrave;y. N&agrave;ng Lọ Lem sẽ phải l&agrave;m g&igrave; khi cuộc đời thực kh&ocirc;ng c&oacute; b&agrave; ti&ecirc;n n&agrave;o xuất hiện gi&uacute;p đỡ c&ocirc; l&uacute;c kh&oacute; khăn?</p>\n<p>&nbsp;</p>\n<p><strong>Darien Freeman</strong>&nbsp;- ch&agrave;ng ho&agrave;ng tử điển trai của kinh đ&ocirc; điện ảnh Hollywood, người sắp thủ vai ch&iacute;nh trong bộ phim Starfield phi&ecirc;n bản mới, đang gặp phải v&ocirc; số rắc rối v&igrave; sự phản đối của cộng đồng người h&acirc;m mộ, cho rằng anh kh&ocirc;ng xứng đ&aacute;ng với vai diễn n&agrave;y. Những g&oacute;c khuất của thế giới showbiz, c&ugrave;ng b&iacute; mật bị che giấu về cuộc đời Darien dần được h&eacute; lộ, tr&ecirc;n h&agrave;nh tr&igrave;nh anh chứng minh bản lĩnh của một Stargunner thực thụ, v&agrave; cũng l&agrave; con đường dẫn anh đến với t&igrave;nh y&ecirc;u đ&iacute;ch thực của đời m&igrave;nh.</p>\n<p>---</p>\n<p>Vẫn c&oacute; gi&agrave;y thuỷ tinh v&agrave; B&iacute; Ng&ocirc; Thần K&igrave;, với ng&ocirc;n từ như được dệt bằng &aacute;nh s&aacute;ng, c&acirc;u chuyện cổ t&iacute;ch t&igrave;nh y&ecirc;u thời hiện đại của Ashley Poston sẽ chiếm lấy tr&aacute;i tim bạn theo c&aacute;ch m&agrave; những chuyện t&igrave;nh l&atilde;ng mạn nhất thế giới khiến bạn phải nhớ m&atilde;i.</p>', '33726b467d6f496c85d55f3b3405c25d.jpg', 'Lọ Lem Mọt Phim', 129000, 45, 15, 12, 0);
INSERT INTO `book` VALUES (11, NULL, NULL, 'admin', '2023-11-27 22:56:31', 'Kuroyanagi Tetsuko', 83000, '<p>Vừa v&agrave;o lớp một được v&agrave;i ng&agrave;y, Totto-chan đ&atilde; bị đuổi học!!!</p>\n<p>Kh&ocirc;ng c&ograve;n c&aacute;ch n&agrave;o kh&aacute;c, mẹ đ&agrave;nh đưa&nbsp;<strong>Totto-chan</strong>&nbsp;đến một ng&ocirc;i trường mới, trường Tomoe. Đấy l&agrave; một ng&ocirc;i trường kỳ lạ, lớp học th&igrave; ở trong toa xe điện cũ, học sinh th&igrave; được thoả th&iacute;ch thay đổi chỗ ngồi mỗi ng&agrave;y, muốn học m&ocirc;n n&agrave;o trước cũng được, chẳng những thế, khi đ&atilde; học hết b&agrave;i, c&aacute;c bạn c&ograve;n được c&ocirc; gi&aacute;o cho đi dạo. Đặc biệt hơn ở đ&oacute; c&ograve;n c&oacute; một thầy hiệu trưởng c&oacute; thể chăm ch&uacute; lắng nghe&nbsp;<strong>Totto-chan</strong>&nbsp;kể chuyện suốt bốn tiếng đồng hồ! Ch&iacute;nh nhờ ng&ocirc;i trường đ&oacute;, một&nbsp;<strong>Totto-chan</strong> hiếu động, c&aacute; biệt đ&atilde; thu nhận được những điều v&ocirc; c&ugrave;ng qu&yacute; gi&aacute; để lớn l&ecirc;n th&agrave;nh một con người ho&agrave;n thiện, mạnh mẽ.</p>\n<p><strong>Totto-chan b&ecirc;n cửa sổ</strong>, l&agrave; cuốn&nbsp;<a href=\"http://bookbuy.vn/sach.html\">s&aacute;ch</a>&nbsp;gối đầu giường của nhiều thế hệ trẻ em tr&ecirc;n to&agrave;n thế giới suốt ba mươi năm nay. Sau khi xuất bản lần đầu v&agrave;o năm 1981, cuốn s&aacute;ch đ&atilde; g&acirc;y được tiếng vang lớn kh&ocirc;ng chỉ ở Nhật Bản m&agrave; c&ograve;n tr&ecirc;n to&agrave;n thế giới. T&iacute;nh đến năm 2001, tổng số bản s&aacute;ch b&aacute;n ra ở Nhật đ&atilde; l&ecirc;n đến 9,3 triệu bản, trở th&agrave;nh một trong những cuốn s&aacute;ch b&aacute;n chạy nhất trong lịch sử ng&agrave;nh xuất bản nước n&agrave;y. Cuốn s&aacute;ch đ&atilde; được dịch ra 33 thứ tiếng kh&aacute;c nhau, như Anh, Ph&aacute;p, Đức, H&agrave;n Quốc, Trung Quốc&hellip;Khi bản tiếng Anh của&nbsp;<strong>Totto-chan</strong> được xuất bản tại Mỹ, tờ New York Times đ&atilde; đăng liền hai b&agrave;i giới thiệu trọn trang, một &ldquo;vinh dự&rdquo; hầu như kh&ocirc;ng t&aacute;c phẩm n&agrave;o c&oacute; được.</p>\n<p><strong>T&aacute;c giả</strong></p>\n<p>Kuroyanagi Tetsuko l&agrave; nh&agrave; văn thiếu nhi, đồng thời l&agrave; một diễn vi&ecirc;n v&agrave; người dẫn chương tr&igrave;nh truyền h&igrave;nh rất nổi tiếng ở Nhật Bản.</p>\n<p>B&agrave; l&agrave; người s&aacute;ng lập ra quỹ Totto Foundation, được đặt t&ecirc;n dựa theo c&ocirc; b&eacute; Totto-chan trong cuốn s&aacute;ch nổi tiếng nhất của b&agrave;. Quỹ Totto Foundation đ&agrave;o tạo c&aacute;c diễn vi&ecirc;n điếc một c&aacute;ch chuy&ecirc;n nghiệp, nhằm hiện thực ho&aacute; &yacute; tưởng mang h&aacute;t kịch đến với những người điếc của Kuroyanagi.</p>\n<p>Năm 1984, , b&agrave; được bổ nhiệm l&agrave;m Đại sứ Thiện ch&iacute; của Quỹ Nhi đồng Li&ecirc;n hiệp quốc, v&agrave; l&agrave; người ch&acirc;u &Aacute; đầu ti&ecirc;n ở vị tr&iacute; n&agrave;y. Trong những năm cuối thập kỉ 80 v&agrave; thập kỉ 90, b&agrave; đ&atilde; đến thăm rất nhiều quốc gia đang ph&aacute;t triển ở ch&acirc;u &Aacute; v&agrave; ch&acirc;u Phi để l&agrave;m từ thiện v&agrave; thực hiện c&aacute;c nhiệm vụ thiện ch&iacute;, gi&uacute;p đỡ trẻ em đang phải chịu cảnh thi&ecirc;n tai v&agrave; chiến tranh, đồng thời n&acirc;ng cao sự ch&uacute; &yacute; của quốc tế đối với trẻ em ở những nước ngh&egrave;o. Kuroyanagi quy&ecirc;n g&oacute;p được hơn 20 triệu đ&ocirc; cho c&aacute;c chương tr&igrave;nh của UNICEF m&agrave; b&agrave; c&oacute; tham gia hoạt động qua c&aacute;c chiến dịch quy&ecirc;n g&oacute;p tr&ecirc;n truyền h&igrave;nh. B&agrave; cũng ủng hộ tiền bản quyền của cuốn s&aacute;ch&nbsp;<strong>Totto-chan</strong>&nbsp;cho UNICEF.</p>\n<p>&nbsp;</p>\n<p>Năm 1997, Kuroyanagi xuất bản cuốn s&aacute;ch Những đứa trẻ của Totto-chan, dựa tr&ecirc;n những trải nghiệm khi b&agrave; l&agrave;m Đại sứ Thiện ch&iacute; của UNICEF từ năm 1984 đến năm 1996.</p>\n<p>Ngo&agrave;i ra, Kuroyanagi c&ograve;n l&agrave; Gi&aacute;m đốc khu vực Nhật Bản của quỹ Bảo tồn Thi&ecirc;n nhi&ecirc;n Thế giới (WWF).</p>\n<p>Với những th&agrave;nh tựu trong lĩnh vực truyền th&ocirc;ng v&agrave; truyền h&igrave;nh, Kuroyanagi đ&atilde; gi&agrave;nh giải thưởng Japanese Cultural Broadcasting, được coi l&agrave; niềm vinh dự cao nhất trong giới truyền h&igrave;nh Nhật Bản. Sau đ&oacute;, b&agrave; đ&atilde; được đề cử 14 lần cho danh hiệu nh&acirc;n vật truyền h&igrave;nh được y&ecirc;u th&iacute;ch nhất Nhật Bản.</p>\n<p>Năm 2000, Kuroyanagi l&agrave; người đầu ti&ecirc;n nhận giải Global Leadership for Children được th&agrave;nh lập bởi UNICEF nh&acirc;n kỉ niệm 10 năm ng&agrave;y Hội nghị Thượng đỉnh Thế giới về Trẻ em năm 1990.</p>\n<p>Th&aacute;ng 5/2003, Kuroyanagi nhận Hu&acirc;n chương Thuỵ Bảo của Nhật Ho&agrave;ng v&igrave; những cống hiến của b&agrave; cho trẻ em thế giới trong suốt hai thập kỉ.</p>', '83c49ec28edf4e9b9b6c00ab5935d6c6.jpg', 'Totto-Chan Bên Cửa Sổ (Tái Bản 2013)', 98000, 45, 15, 1, 0);
INSERT INTO `book` VALUES (12, NULL, NULL, 'admin', '2023-11-27 23:01:03', 'Lạc An', 68000, '<p>Lo&agrave;i m&egrave;o đ&atilde; đồng h&agrave;nh với con người qua nhiều giai đoạn thăng trầm của lịch sử. Ch&uacute;ng l&agrave; một trong những lo&agrave;i th&uacute; cưng được con người y&ecirc;u thương bậc nhất. Bạn c&oacute; thể thấy h&igrave;nh ảnh m&egrave;o ngập tr&agrave;n khắp nơi, từ nh&agrave; ra đường, tr&ecirc;n những m&oacute;n đồ trang tr&iacute;, s&aacute;ch b&aacute;o, mạng x&atilde; hội...<br>Liệu c&oacute; phải những cục b&ocirc;ng bốn ch&acirc;n đ&aacute;ng y&ecirc;u n&agrave;y đang dần... x&acirc;m chiếm thế giới? H&atilde;y c&ugrave;ng theo d&otilde;i cuốn nhật k&iacute; đ&aacute;ng y&ecirc;u d&agrave;nh ri&ecirc;ng cho những ch&uacute; m&egrave;o nổi tiếng thế giới nh&eacute;!</p>', '8c5bcbbb7d594e35aa688f4acf7df7dd.jpg', 'Nhật Kí Nghiên Cứu Những Chú Mèo Nổi Tiếng', 80000, 45, 15, 1, 0);
INSERT INTO `book` VALUES (13, 'admin', '2023-11-27 23:03:10', 'admin', '2023-11-27 23:03:10', 'Nhiều tác giả', 45000, '<p>BỘ S&Aacute;CH H&Agrave;I HƯỚC V&Agrave; ĐẦY TH&Uacute; VỊ VỀ X&Oacute;M G&Agrave; Đ&Atilde; TRỞ LẠI VỚI C&Aacute;C B&Eacute; Đ&Acirc;Y!</p>\n<p>&ldquo;C&uacute;c c&ugrave; l&eacute;c cu!&rdquo;, Pitikok ch&uacute; g&agrave; gi&ograve; đỏ ma lanh, l&ecirc;n đường giải cứu một chiếc l&ocirc;ng vũ thần kỳ bị giam cầm giữa sa mạc.</p>\n<p>Một con rắn c&aacute;t tốt bụng chấp nhận đồng h&agrave;nh để gi&uacute;p đỡ ch&uacute;. Hai người bao giờ chẳng mạnh hơn một người&hellip;</p>', '74fa4dfc3f9d479092b0c1f31c135972.jpg', 'Lại Chuyện Xóm Gà - Pitikok Và Chiếc Lông Vũ Thần Kỳ', 50000, 50, 10, 1, 0);
