INSERT INTO `book` VALUES (16, 'admin', '2023-11-27 23:07:16', 'admin', '2023-11-27 23:07:16', 'Nhiều tác giả', 45000, '<p>BỘ S&Aacute;CH H&Agrave;I HƯỚC V&Agrave; ĐẦY TH&Uacute; VỊ VỀ X&Oacute;M G&Agrave; Đ&Atilde; TRỞ LẠI VỚI C&Aacute;C B&Eacute; Đ&Acirc;Y!</p>\n<p>&ldquo;C&uacute;c c&ugrave; l&eacute;c cu!&rdquo; Pitikok, ch&uacute; g&agrave; gi&ograve; đỏ dũng cảm, kh&ocirc;ng sao tin nổi v&agrave;o mắt m&igrave;nh. Ch&uacute; vừa t&igrave;m ra một ch&uacute; c&aacute; đi dạo giữa khu rừng. Kỳ lạ qu&aacute; phải kh&ocirc;ng n&agrave;o?</p>\n<p>Nhưng một ch&uacute; c&aacute; c&oacute; ria th&igrave; l&agrave;m g&igrave; được khi ở xa d&ograve;ng s&ocirc;ng đến vậy nhỉ?</p>', '062643b1310e4eaba523ba5082578e6d.jpg', 'Lại Chuyện Xóm Gà - Pitikok Và Con Cá Có Ria', 50000, 50, 10, 1, 0);
INSERT INTO `book` VALUES (17, 'admin', '2023-11-27 23:08:02', 'admin', '2023-11-27 23:08:02', 'Nhiều tác giả', 45000, '<p>BỘ S&Aacute;CH H&Agrave;I HƯỚC V&Agrave; ĐẦY TH&Uacute; VỊ VỀ X&Oacute;M G&Agrave; Đ&Atilde; TRỞ LẠI VỚI C&Aacute;C B&Eacute; Đ&Acirc;Y!</p>\n<p>&ldquo;C&uacute;c c&ugrave; l&eacute;c cu!&rdquo; Pitikok, ch&uacute; g&agrave; gi&ograve; đỏ dũng cảm, kh&ocirc;ng sao tin nổi v&agrave;o mắt m&igrave;nh. Ch&uacute; vừa t&igrave;m ra một ch&uacute; c&aacute; đi dạo giữa khu rừng. Kỳ lạ qu&aacute; phải kh&ocirc;ng n&agrave;o?</p>\n<p>Nhưng một ch&uacute; c&aacute; c&oacute; ria th&igrave; l&agrave;m g&igrave; được khi ở xa d&ograve;ng s&ocirc;ng đến vậy nhỉ?</p>', '6a078e9bac5f43f7b6cd9451d0399095.jpg', 'Lại Chuyện Xóm Gà - Pitikok Và Bê Rừng Bé Bỏng', 50000, 50, 10, 1, 0);
INSERT INTO `book` VALUES (18, 'admin', '2023-11-27 23:10:47', 'admin', '2023-11-27 23:10:47', 'Đăng Ngọc Minh', 29500, '<p>Gi&aacute;o dục giới t&iacute;nh v&agrave; nh&acirc;n c&aacute;ch d&agrave;nh cho b&eacute; g&aacute;i l&agrave; bộ s&aacute;ch rất bổ &iacute;ch, gi&uacute;p c&aacute;c b&eacute; g&aacute;i c&oacute; h&agrave;nh vi, ng&ocirc;n ngữ, cử chỉ đ&uacute;ng mực, biết đo&agrave;n kết y&ecirc;u thương, chia sẻ với mọi người.</p>\n<p>Đặc biệt, th&ocirc;ng qua cuốn s&aacute;ch&nbsp;Tớ l&agrave; c&ocirc; b&eacute; lạc quan, y&ecirc;u đời, c&aacute;c b&eacute; g&aacute;i sẽ học được c&aacute;ch xử l&yacute; c&aacute;c t&igrave;nh huống kh&ocirc;ng như &yacute; muốn ở nh&agrave;, ở lớp hay ở ngo&agrave;i x&atilde; hội bằng th&aacute;i độ lạc quan, t&iacute;ch cực v&agrave; tinh thần tự tin, dũng cảm.</p>\n<p>Bộ s&aacute;ch n&agrave;y chắc chắn l&agrave; m&oacute;n qu&agrave; nhỏ tuyệt vời để bố mẹ v&agrave; thầy c&ocirc; gửi tặng c&aacute;c con, gi&uacute;p c&aacute;c con cư xử đ&uacute;ng mực, th&ocirc;ng minh trong mọi t&igrave;nh huống, mọi ho&agrave;n cảnh.</p>', '7f5f2346b4644dcaacd1591b224c453b.jpg', 'Giáo Dục Giới Tính Và Nhân Cách Dành Cho Bé Gái - Mọi Điều Bé Gái Cần Phải Biết - Tớ Là Cô Bé Lạc Quan, Yêu Đời - Dạy Trẻ Có Suy Nghĩ Và Hành Động Tích Cực', 35000, 45, 15, 1, 0);
INSERT INTO `book` VALUES (19, 'admin', '2023-11-27 23:11:23', 'admin', '2023-11-27 23:11:23', 'Đăng Ngọc Minh', 29500, '<p>Gi&aacute;o dục giới t&iacute;nh v&agrave; nh&acirc;n c&aacute;ch d&agrave;nh cho b&eacute; g&aacute;i l&agrave; bộ s&aacute;ch rất bổ &iacute;ch, gi&uacute;p c&aacute;c b&eacute; g&aacute;i c&oacute; h&agrave;nh vi, ng&ocirc;n ngữ, cử chỉ đ&uacute;ng mực, biết đo&agrave;n kết y&ecirc;u thương, chia sẻ với mọi người.</p>\n<p>Đặc biệt, th&ocirc;ng qua cuốn s&aacute;ch&nbsp;Tớ l&agrave; c&ocirc; b&eacute; lạc quan, y&ecirc;u đời, c&aacute;c b&eacute; g&aacute;i sẽ học được c&aacute;ch xử l&yacute; c&aacute;c t&igrave;nh huống kh&ocirc;ng như &yacute; muốn ở nh&agrave;, ở lớp hay ở ngo&agrave;i x&atilde; hội bằng th&aacute;i độ lạc quan, t&iacute;ch cực v&agrave; tinh thần tự tin, dũng cảm.</p>\n<p>Bộ s&aacute;ch n&agrave;y chắc chắn l&agrave; m&oacute;n qu&agrave; nhỏ tuyệt vời để bố mẹ v&agrave; thầy c&ocirc; gửi tặng c&aacute;c con, gi&uacute;p c&aacute;c con cư xử đ&uacute;ng mực, th&ocirc;ng minh trong mọi t&igrave;nh huống, mọi ho&agrave;n cảnh.</p>', 'f09686b6f71b424e9bb87fffb910766d.jpg', 'Giáo Dục Giới Tính Và Nhân Cách Dành Cho Bé Gái - Tớ Là Cô Bé Lịch Sự, Văn Minh - Dạy Trẻ Có Hành Vi, Cử Chỉ, Ngôn Ngữ Đúng Mực', 35000, 45, 15, 1, 0);
INSERT INTO `book` VALUES (20, 'admin', '2023-11-27 23:12:03', 'admin', '2023-11-27 23:12:03', 'Đăng Ngọc Minh', 29500, '<p>Gi&aacute;o dục giới t&iacute;nh v&agrave; nh&acirc;n c&aacute;ch d&agrave;nh cho b&eacute; g&aacute;i l&agrave; bộ s&aacute;ch rất bổ &iacute;ch, gi&uacute;p c&aacute;c b&eacute; g&aacute;i c&oacute; h&agrave;nh vi, ng&ocirc;n ngữ, cử chỉ đ&uacute;ng mực, biết đo&agrave;n kết y&ecirc;u thương, chia sẻ với mọi người.</p>\n<p>Đặc biệt, th&ocirc;ng qua cuốn s&aacute;ch&nbsp;Tớ l&agrave; c&ocirc; b&eacute; lạc quan, y&ecirc;u đời, c&aacute;c b&eacute; g&aacute;i sẽ học được c&aacute;ch xử l&yacute; c&aacute;c t&igrave;nh huống kh&ocirc;ng như &yacute; muốn ở nh&agrave;, ở lớp hay ở ngo&agrave;i x&atilde; hội bằng th&aacute;i độ lạc quan, t&iacute;ch cực v&agrave; tinh thần tự tin, dũng cảm.</p>\n<p>Bộ s&aacute;ch n&agrave;y chắc chắn l&agrave; m&oacute;n qu&agrave; nhỏ tuyệt vời để bố mẹ v&agrave; thầy c&ocirc; gửi tặng c&aacute;c con, gi&uacute;p c&aacute;c con cư xử đ&uacute;ng mực, th&ocirc;ng minh trong mọi t&igrave;nh huống, mọi ho&agrave;n cảnh.</p>', '758c7358282c421b9d12465b785c8325.jpg', 'Giáo Dục Giới Tính Và Nhân Cách Dành Cho Bé Gái - Mọi Điều Bé Gái Cần Phải Biết - Tớ Là Cô Bé Tự Lập - Dạy Trẻ Kỹ Năng Tự Giác Hoàn Thành Công', 35000, 45, 15, 1, 0);
INSERT INTO `book` VALUES (21, 'admin', '2023-11-27 23:16:22', 'admin', '2023-11-27 23:16:23', 'Stefan Engesetth', 63500, '<p>L&agrave;m sao để tấn c&ocirc;ng kẻ đang thống lĩnh thị trường v&agrave; l&agrave;m sao để tồn tại, chống lại c&aacute;c cuộc tấn c&ocirc;ng? Được gợi cảm hứng từ c&aacute; mập trắng, những sinh vật hung bạo nhất v&agrave; mạnh mẽ nhất của đại dương, t&aacute;c giả đ&atilde; &aacute;p dụng những chiến thuật săn mồi cũng như tr&aacute;nh bị săn của c&aacute; mập v&agrave;o lĩnh vực&nbsp;<a href=\"http://bookbuy.vn/sach/sach-kinh-te\">kinh tế</a>. Bạn đọc c&oacute; thể học được từ v&ocirc; v&agrave;n những c&acirc;u chuyện hấp dẫn v&agrave; sống động của c&aacute;c tập đo&agrave;n lớn nhất tr&ecirc;n thế giới, c&ugrave;ng l&uacute;c với những chiến thuật v&agrave; tập qu&aacute;n của lo&agrave;i c&aacute; mập trắng. Một quyển s&aacute;ch bạo liệt v&agrave; kh&ocirc;ng khoan nhượng, d&agrave;nh cho một thương trường &aacute;c liệt v&agrave; đầy cạnh tranh.</p>', '871a6a430aff401fa7cdb612c43a4630.jpg', 'Kinh Tế Học Cá Mập', 75000, 30, 15, 10, 0);
INSERT INTO `book` VALUES (22, 'admin', '2023-11-27 23:18:12', 'admin', '2023-11-27 23:18:12', 'Aaron McDaniel', 228500, '<p>Thế giới kinh doanh đ&atilde; thay đổi v&agrave; để lu&ocirc;n dẫn đầu, c&aacute;c c&ocirc;ng ty phải suy nghĩ, vận h&agrave;nh v&agrave; mở rộng quy m&ocirc; theo c&aacute;ch kh&aacute;c. C&aacute;c c&ocirc;ng ty cần &aacute;p dụng tư duy mới v&agrave; x&acirc;y dựng c&aacute;c nh&oacute;m ph&acirc;n t&aacute;n với bộ kỹ năng độc đ&aacute;o để th&agrave;nh c&ocirc;ng ở c&aacute;c thị trường mới. Một c&aacute;ch tiếp cận chiến lược mới v&agrave; sửa đổi phương ph&aacute;p linh hoạt l&agrave; cần thiết để c&acirc;n bằng tốt hơn nhu cầu bản địa h&oacute;a với sự phức tạp m&agrave; bản địa h&oacute;a tạo ra.</p>\n<p>Th&ocirc;ng qua c&aacute;c nghi&ecirc;n cứu điển h&igrave;nh v&agrave; hiểu biết s&acirc;u sắc từ hơn 250 c&ocirc;ng ty ph&aacute;t triển nhanh nhất thế giới, Aaron McDaniel v&agrave; Klaus Wehage l&agrave;m s&aacute;ng tỏ những g&igrave; m&agrave; loại h&igrave;nh kinh doanh mới n&agrave;y (\"C&ocirc;ng ty đẳng cấp to&agrave;n cầu\") l&agrave;m để th&agrave;nh c&ocirc;ng, những người l&agrave; chất x&uacute;c t&aacute;c cho sự ph&aacute;t triển của họ (\"Người phi&ecirc;n dịch\") v&agrave; c&aacute;ch họ l&agrave;m điều đ&oacute;.</p>\n<p>Từ th&acirc;m nhập thị trường đến tăng trưởng quốc tế, cuốn s&aacute;ch giới thiệu một bộ c&ocirc;ng cụ to&agrave;n diện gồm c&aacute;c khu&ocirc;n khổ thực tế cung cấp kế hoạch chi tiết về c&aacute;ch x&acirc;y dựng v&agrave; quản l&yacute; một doanh nghiệp to&agrave;n cầu.</p>', 'd7d47c43433b41caac9af13d7e4148f3.jpg', 'Doanh Nghiệp Vương Tầm Thế Giới - Global Class', 269000, 30, 15, 10, 0);
INSERT INTO `book` VALUES (23, 'admin', '2023-11-27 23:19:28', 'admin', '2023-11-27 23:19:28', 'Andrea Fryrear', 228500, '<p>L&agrave; một nh&agrave; marketing, bạn c&oacute; cảm thấy mệt mỏi khi theo đuổi những mốt marketing nhất thời v&agrave; những tin đồn về thuật to&aacute;n dường như thay đổi v&agrave;i th&aacute;ng một lần kh&ocirc;ng?</p>\n<p><a href=\"https://www.netabooks.vn/agile-marketing\" target=\"_blank\" rel=\"noopener\">Agile Marketing</a>&nbsp;l&agrave; cuốn s&aacute;ch hướng dẫn x&acirc;y dựng đội nh&oacute;m marketing ho&agrave;n hảo gi&uacute;p bạn đạt được những th&agrave;nh tựu tốt nhất m&agrave; kh&ocirc;ng cần phải x&acirc;y dựng lại từ đầu kế hoạch, định hướng của m&igrave;nh mỗi khi xu hướng thị trường thay đổi.</p>\n<p>Cuốn s&aacute;ch n&agrave;y l&agrave; một tấm biển chỉ dẫn con đường hướng tới tương lai linh hoạt của c&aacute;c hoạt động marketing. Với&nbsp;<a href=\"https://www.netabooks.vn/agile-marketing\" target=\"_blank\" rel=\"noopener\">Agile Marketing</a>, từ thực tập sinh truyền th&ocirc;ng x&atilde; hội cho đến gi&aacute;m đốc marketing c&oacute; thể phối hợp l&agrave;m việc, đ&aacute;p ứng những th&aacute;ch thức khắt khe của thị trường m&agrave; kh&ocirc;ng mất tập trung v&agrave;o bức tranh to&agrave;n cảnh.</p>\n<p>Bạn sẽ t&igrave;m hiểu những điều cần thiết để marketing linh hoạt ph&aacute;t triển &ndash; tập trung v&agrave;o kh&aacute;ch h&agrave;ng, t&iacute;nh minh bạch, cải tiến li&ecirc;n tục, khả năng th&iacute;ch ứng, sự tin cậy, thi&ecirc;n hướng h&agrave;nh động v&agrave; l&ograve;ng dũng cảm. Quan trọng nhất, bạn sẽ học c&aacute;ch triển khai c&aacute;c hệ thống, chiến lược v&agrave; hoạt động marketing.</p>', '5793d505aa31471f99a396d7ff82642e.jpg', 'Agile Marketing', 269000, 30, 15, 10, 0);
INSERT INTO `book` VALUES (24, 'admin', '2023-11-27 23:21:41', 'admin', '2023-11-27 23:21:41', 'John C. Maxwell', 152000, '<p>rong văn h&oacute;a&nbsp;<em>&ldquo;m&igrave; ăn liền&rdquo;</em>&nbsp;ng&agrave;y nay, ch&uacute;ng ta thường muốn r&uacute;t ngắn tư duy, suy ngẫm v&agrave; h&agrave;nh động trong tiến tr&igrave;nh ph&aacute;t triển để trở th&agrave;nh nh&agrave; l&atilde;nh đạo. Tuy nhi&ecirc;n, hiểu biết của ch&uacute;ng ta về năng lực l&atilde;nh đạo cần thời gian để t&iacute;ch lũy. Để hiểu được qu&aacute; tr&igrave;nh ph&aacute;t triển v&agrave; sự ảnh hưởng của c&aacute;c nh&agrave; l&atilde;nh đạo, ch&uacute;ng ta phải c&oacute; sự s&aacute;ng suốt, kh&ocirc;n ngoan v&agrave; hiểu biết.</p>\n<p>Ph&aacute;t triển l&atilde;nh đạo, hay qu&aacute; tr&igrave;nh sản sinh những nh&agrave; l&atilde;nh đạo mới, l&agrave; ch&igrave;a kh&oacute;a cho sự th&agrave;nh c&ocirc;ng d&agrave;i hạn của mỗi doanh nghiệp, bởi khi ngừng ph&aacute;t triển l&atilde;nh đạo, doanh nghiệp ngừng tăng trưởng. Trong cuốn s&aacute;ch mới n&agrave;y, t&aacute;c giả nổi tiếng nhất về l&atilde;nh đạo sẽ dẫn dắt người đọc từng bước, từ x&aacute;c định, thu h&uacute;t, hiểu r&otilde;, kh&iacute;ch lệ, trang bị, trao quyền, định vị, đến cố vấn nh&agrave; l&atilde;nh đạo, từ đ&oacute; h&igrave;nh th&agrave;nh văn h&oacute;a l&atilde;nh đạo - nơi t&aacute;i tạo v&agrave; cộng dồn gi&aacute; trị của c&aacute;c nh&agrave; l&atilde;nh đạo.</p>\n<p>Đối với mỗi c&aacute; nh&acirc;n nh&agrave; l&atilde;nh đạo muốn tiến xa hơn nữa tr&ecirc;n chiếc thang l&atilde;nh đạo, hay đối với mỗi doanh nghiệp muốn tăng trưởng bền vững v&agrave; tạo gi&aacute; trị d&agrave;i hạn, cuốn s&aacute;ch&nbsp;<a href=\"https://www.netabooks.vn/pham-chat-lanh-dao-kien-tao-tuong-lai\" target=\"_blank\" rel=\"noopener\">PHẨM CHẤT L&Atilde;NH ĐẠO - KIẾN TẠO TƯƠNG LAI</a> ch&iacute;nh l&agrave; ch&igrave;a kh&oacute;a. Ph&aacute;t triển nh&acirc;n lực kế cận l&agrave; nơi nh&agrave; l&atilde;nh đạo thực sự trải nghiệm nh&acirc;n cấp gi&aacute; trị của việc ph&aacute;t triển nh&agrave; l&atilde;nh đạo v&agrave; bước l&ecirc;n nấc thang cao nhất của h&agrave;nh tr&igrave;nh l&atilde;nh đạo.</p>', '968059bb76394b3f98bea2ea805c6cd9.jpg', 'Phẩm Chất Lãnh Đạo - Kiến Tạo Tương Lai', 179000, 37, 12, 10, 0);
INSERT INTO `book` VALUES (25, 'admin', '2023-11-27 23:23:40', 'admin', '2023-11-27 23:23:40', 'Inbal Arieli', 112000, '<p>Vị tỷ ph&uacute; nổi tiếng Warren Buffett từng n&oacute;i:&nbsp;<em>&ldquo;Nếu bạn đến Trung Đ&ocirc;ng để t&igrave;m kiếm dầu, bạn c&oacute; thể bỏ qua Israel. C&ograve;n nếu bạn đang t&igrave;m kiếm những bộ n&atilde;o tr&iacute; tuệ, đ&acirc;y ch&iacute;nh l&agrave; đ&iacute;ch đến của bạn. Israel đ&atilde; chứng minh rằng quốc gia n&agrave;y sở hữu một số lượng khổng lồ những bộ n&atilde;o tr&iacute; tuệ v&agrave; nguồn năng lượng tuyệt vời&rdquo;</em>.</p>\n<p>T&iacute;nh đến hiện nay, Israel c&oacute; tỷ lệ c&ocirc;ng ty khởi nghiệp tr&ecirc;n đầu người cao nhất thế giới, đứng thứ 3 trong số 138 quốc gia tr&ecirc;n Bảng xếp hạng s&aacute;ng tạo của Diễn đ&agrave;n Kinh tế Thế giới (WEF), sở hữu số lượng c&ocirc;ng ty được ni&ecirc;m yết tr&ecirc;n s&agrave;n giao dịch chứng kho&aacute;n Nasdaq cao nhất (t&iacute;nh đến năm 2018, chỉ đứng sau Hoa Kỳ v&agrave; Trung Quốc)... v&agrave; được mệnh danh l&agrave;&nbsp;<em>Quốc gia khởi nghiệp</em>.</p>\n<p>Vậy điều g&igrave; đ&atilde; khiến Israel trở th&agrave;nh c&aacute;i n&ocirc;i của sự đổi mới? Tại sao người Israel lu&ocirc;n kh&ocirc;ng ngừng bận rộn với những ph&aacute;t kiến mới? Trong&nbsp;<a href=\"https://www.netabooks.vn/tinh-than-chutzpah-tai-sao-israel-duoc-xem-la-trung-tam-cua-su-doi-moi-va-hoat-dong-khoi-nghiep\" target=\"_blank\" rel=\"noopener\">Tinh thần chutzpah&nbsp;-&nbsp;Tại sao&nbsp;Israel được xem l&agrave; trung t&acirc;m của sự đổi mới v&agrave; hoạt động khởi nghiệp?</a>, nữ t&aacute;c giả Inbal Arieli đ&atilde; gi&uacute;p ch&uacute;ng ta giải đ&aacute;p những thắc mắc n&agrave;y.</p>', '098cc93d2af646ef81a4b9d38abe77ec.jpg', 'Tinh Thần Chutzpah - Tại Sao Israel Được Xem Là Trung Tâm Của Sự Đổi Mới Và Hoạt Động Khởi Nghiệp?', 159000, 30, 12, 10, 0);
INSERT INTO `book` VALUES (26, 'admin', '2023-11-27 23:29:27', 'admin', '2023-11-27 23:29:28', 'DK', 331500, '<p>C&oacute; đ&uacute;ng chăng khi ch&uacute;ng ta lật đổ một nh&agrave; cai trị bất c&ocirc;ng? Liệu nền d&acirc;n chủ c&oacute; thực sự l&agrave; h&igrave;nh thức ch&iacute;nh quyền tốt nhất? V&agrave; chiến tranh c&oacute; thể được biện minh hay kh&ocirc;ng? Xuy&ecirc;n suốt chiều d&agrave;i lịch sử, lo&agrave;i người đ&atilde; tự hỏi m&igrave;nh những điều n&agrave;y c&ugrave;ng những c&acirc;u hỏi lớn lao kh&aacute;c về c&aacute;ch thức tốt nhất để ch&uacute;ng ta cai trị ch&iacute;nh m&igrave;nh &ndash; v&agrave; c&aacute;c tư tưởng gia vĩ đại đ&atilde; đưa ra những lời giải đ&aacute;p m&agrave; cho đến nay vẫn đang tiếp tục định h&igrave;nh thế giới.</p>\n<p>Với văn phong dễ hiểu v&agrave; s&aacute;ng sủa,&nbsp;<em>Ch&iacute;nh trị - Kh&aacute;i lược những tư tưởng lớn&nbsp;</em>l&agrave; tập hợp những b&agrave;i viết ngắn gọn h&agrave;m s&uacute;c giải th&iacute;ch r&otilde; những điều kh&oacute; hiểu, những sơ đồ từng bước gi&uacute;p l&agrave;m s&aacute;ng tỏ những l&iacute; thuyết rối rắm, v&agrave; những h&igrave;nh ảnh minh họa d&iacute; dỏm gi&uacute;p ch&uacute;ng ta &yacute; thức r&otilde; hơn về vai tr&ograve; của m&igrave;nh trong c&aacute;ch thức tổ chức x&atilde; hội.</p>', 'fe268047e75748fda7537cf5696ae7c7.jpg', 'Chính Trị - Khái Lược Những Tư Tưởng Lớn', 390000, 10, 15, 9, 0);
INSERT INTO `book` VALUES (27, 'admin', '2023-11-27 23:30:49', 'admin', '2023-11-27 23:30:49', 'Francis Fukuyama', 228000, '<p>C&oacute; đ&uacute;ng chăng khi ch&uacute;ng ta lật đổ một nh&agrave; cai trị bất c&ocirc;ng? Liệu nền d&acirc;n chủ c&oacute; thực sự l&agrave; h&igrave;nh thức ch&iacute;nh quyền tốt nhất? V&agrave; chiến tranh c&oacute; thể được biện minh hay kh&ocirc;ng? Xuy&ecirc;n suốt chiều d&agrave;i lịch sử, lo&agrave;i người đ&atilde; tự hỏi m&igrave;nh những điều n&agrave;y c&ugrave;ng những c&acirc;u hỏi lớn lao kh&aacute;c về c&aacute;ch thức tốt nhất để ch&uacute;ng ta cai trị ch&iacute;nh m&igrave;nh &ndash; v&agrave; c&aacute;c tư tưởng gia vĩ đại đ&atilde; đưa ra những lời giải đ&aacute;p m&agrave; cho đến nay vẫn đang tiếp tục định h&igrave;nh thế giới.</p>\n<p>Với văn phong dễ hiểu v&agrave; s&aacute;ng sủa,&nbsp;<em>Ch&iacute;nh trị - Kh&aacute;i lược những tư tưởng lớn&nbsp;</em>l&agrave; tập hợp những b&agrave;i viết ngắn gọn h&agrave;m s&uacute;c giải th&iacute;ch r&otilde; những điều kh&oacute; hiểu, những sơ đồ từng bước gi&uacute;p l&agrave;m s&aacute;ng tỏ những l&iacute; thuyết rối rắm, v&agrave; những h&igrave;nh ảnh minh họa d&iacute; dỏm gi&uacute;p ch&uacute;ng ta &yacute; thức r&otilde; hơn về vai tr&ograve; của m&igrave;nh trong c&aacute;ch thức tổ chức x&atilde; hội.</p>', 'cf2e694e045743509e27d7199c733e38.png', 'Nguồn Gốc Trật Tự Chính Trị', 390000, 15, 10, 9, 0);
INSERT INTO `book` VALUES (28, 'admin', '2023-11-27 23:31:35', 'admin', '2023-11-27 23:31:35', 'Francis Fukuyama', 228000, '<p>C&oacute; đ&uacute;ng chăng khi ch&uacute;ng ta lật đổ một nh&agrave; cai trị bất c&ocirc;ng? Liệu nền d&acirc;n chủ c&oacute; thực sự l&agrave; h&igrave;nh thức ch&iacute;nh quyền tốt nhất? V&agrave; chiến tranh c&oacute; thể được biện minh hay kh&ocirc;ng? Xuy&ecirc;n suốt chiều d&agrave;i lịch sử, lo&agrave;i người đ&atilde; tự hỏi m&igrave;nh những điều n&agrave;y c&ugrave;ng những c&acirc;u hỏi lớn lao kh&aacute;c về c&aacute;ch thức tốt nhất để ch&uacute;ng ta cai trị ch&iacute;nh m&igrave;nh &ndash; v&agrave; c&aacute;c tư tưởng gia vĩ đại đ&atilde; đưa ra những lời giải đ&aacute;p m&agrave; cho đến nay vẫn đang tiếp tục định h&igrave;nh thế giới.</p>\n<p>Với văn phong dễ hiểu v&agrave; s&aacute;ng sủa,&nbsp;<em>Ch&iacute;nh trị - Kh&aacute;i lược những tư tưởng lớn&nbsp;</em>l&agrave; tập hợp những b&agrave;i viết ngắn gọn h&agrave;m s&uacute;c giải th&iacute;ch r&otilde; những điều kh&oacute; hiểu, những sơ đồ từng bước gi&uacute;p l&agrave;m s&aacute;ng tỏ những l&iacute; thuyết rối rắm, v&agrave; những h&igrave;nh ảnh minh họa d&iacute; dỏm gi&uacute;p ch&uacute;ng ta &yacute; thức r&otilde; hơn về vai tr&ograve; của m&igrave;nh trong c&aacute;ch thức tổ chức x&atilde; hội.</p>', '44918d3ed7f1437dabe66deca90082dc.png', 'Trật Tự Chính Trị Và Suy Tàn Chính Trị', 390000, 15, 10, 9, 0);
INSERT INTO `book` VALUES (29, 'admin', '2023-11-27 23:33:34', 'admin', '2023-11-27 23:33:34', 'Tim Marshall', 178000, '<p>Những l&aacute; cờ từ l&acirc;u vẫn l&agrave; một biểu tượng c&oacute; quyền lực lớn lao, truyền đạt nhanh ch&oacute;ng c&aacute;c th&ocirc;ng điệp v&agrave; thể hiện cảm x&uacute;c mạnh mẽ.</p>\n<p>Ch&uacute;ng cũng đồng h&agrave;nh c&ugrave;ng với những phong tr&agrave;o lớn của c&aacute;c l&yacute; tưởng, d&acirc;n tộc v&agrave; t&ocirc;n gi&aacute;o để biểu trưng cho những bước ngoặt trong lịch sử hay những thay đổi trong tiến tr&igrave;nh ph&aacute;t triển, thể hiện nỗ lực đo&agrave;n kết hoặc g&acirc;y chia rẽ th&ocirc;ng qua gieo rắc nỗi sợ h&atilde;i.</p>\n<p>Qua ch&iacute;n chương s&aacute;ch, t&aacute;c giả đ&atilde; đưa ra được hầu hết những l&aacute; cờ điển h&igrave;nh của c&aacute;c cường quốc v&agrave; những khu vực lớn tr&ecirc;n thế giới như: Mỹ, Anh, Li&ecirc;n minh ch&acirc;u &Acirc;u, Trung Đ&ocirc;ng, ch&acirc;u &Aacute;, ch&acirc;u Phi, Mỹ Latin v&agrave; cả những l&aacute; cờ của c&aacute;c tổ chức khủng bố.</p>\n<p>Mỗi l&aacute; cờ đều chứa đựng những c&acirc;u chuyện b&iacute; mật, kh&ocirc;ng chỉ về nguồn gốc v&agrave; &yacute; nghĩa của từng biểu tượng gắn tr&ecirc;n ch&uacute;ng c&ograve;n cả lịch sử l&acirc;u d&agrave;i về t&ocirc;n gi&aacute;o v&agrave; sắc tộc m&agrave; c&oacute; thể lần đầu ti&ecirc;n ta được nghe tới.</p>\n<h2>Nhận x&eacute;t về cuốn s&aacute;ch&nbsp;Chết Cho M&agrave;u Cờ - Quyền Lực V&agrave; Ch&iacute;nh Trị Của Những L&aacute; Cờ (B&igrave;a Cứng)</h2>\n<p><em>&ldquo;<a href=\"https://www.netabooks.vn/tac-gia/tim-marshall-16564\" target=\"_blank\" rel=\"noopener\">Marshall</a>&nbsp;đ&atilde; chỉ cho ta thấy rằng ch&uacute;ng ta thường qu&ecirc;n mất t&iacute;nh biểu tượng g&acirc;y hấn của c&aacute;c l&aacute; cờ l&acirc;u đời... ch&uacute;ng l&agrave; c&aacute;ch truyền đạt l&ograve;ng trung th&agrave;nh, quyền lực v&agrave; l&yacute; tưởng nhanh ch&oacute;ng v&agrave; trực quan.&rdquo;</em>&nbsp;&ndash;&nbsp;<strong>The Times (UK)</strong></p>', '8da49e3f00454ea688642b14cde5e113.jpg', 'Chết Cho Màu Cờ - Quyền Lực Và Chính Trị Của Những Lá Cờ', 390000, 19, 25, 9, 0);
INSERT INTO `book` VALUES (30, 'admin', '2023-11-27 23:35:21', 'admin', '2023-11-27 23:35:21', 'Marjorie Randon', 178000, '<p><strong>&ldquo;Ch&iacute;nh Trị Đảng Ph&aacute;i Tại Hoa Kỳ</strong>&rdquo; (t&ecirc;n tiếng anh: &ldquo;<strong>Parties Politics in America</strong>&rdquo;) l&agrave; cuốn gi&aacute;o tr&igrave;nh kinh điển về c&aacute;c đảng ch&iacute;nh trị, được sử dụng rộng r&atilde;i trong giảng dạy tại c&aacute;c trường đại học của Mỹ.</p>\n<p>Cuốn s&aacute;ch n&agrave;y li&ecirc;n tục được cập nhật nhưng mục đ&iacute;ch th&igrave; kh&ocirc;ng đổi. Hiện nay cuốn s&aacute;ch đ&atilde; được t&aacute;i bản 17 lần, phi&ecirc;n bản tiếng Việt n&agrave;y dựa tr&ecirc;n ấn bản thứ 16.</p>\n<p>Frank J. Sorauf, một người ti&ecirc;n phong trong khoa học ch&iacute;nh trị hiện đại, đ&atilde; khởi xướng t&aacute;c phẩm v&agrave;o năm 1968, v&agrave; Paul Allen Beck đưa cuốn s&aacute;ch tới c&ocirc;ng ch&uacute;ng v&agrave;o thập ni&ecirc;n 1980, 1990, với sự hiểu biết s&acirc;u rộng v&agrave; g&oacute;c nh&igrave;n mang t&iacute;nh chất so s&aacute;nh ghi dấu c&aacute;c nghi&ecirc;n cứu của &ocirc;ng về đảng ph&aacute;i v&agrave; h&agrave;nh vi bầu cử. Marjorie Randon Hershey l&agrave; người đ&atilde; cập nhật cho cuốn s&aacute;ch n&agrave;y từ ấn bản thứ 9 &ndash; từ năm 2001 đến nay.</p>\n<p>Mục đ&iacute;ch của họ qua mỗi ấn bản mới l&agrave; cung cấp cho người học những kiến thức hấp dẫn, r&otilde; r&agrave;ng nhất v&agrave; to&agrave;n diện nhất về đảng ph&aacute;i ch&iacute;nh trị v&agrave; t&iacute;nh đảng, m&agrave; ch&iacute;nh đ&oacute; l&agrave; ch&igrave;a kh&oacute;a để hiểu về hoạt động bầu cử, c&ocirc;ng luận, x&acirc;y dựng ch&iacute;nh s&aacute;ch v&agrave; l&atilde;nh đạo. C&aacute;c t&aacute;c giả đ&atilde; th&agrave;nh c&ocirc;ng tới mức t&aacute;c phẩm &ldquo;Ch&iacute;nh trị Đảng ph&aacute;i tại Hoa Kỳ&rdquo; từ l&acirc;u được xem l&agrave; &ldquo;ti&ecirc;u chuẩn v&agrave;ng&rdquo; cho c&aacute;c gi&aacute;o tr&igrave;nh về đảng ph&aacute;i ch&iacute;nh trị.&rdquo;</p>\n<p>Marjorie Randon Hershey, th&ocirc;ng qua kiến thức chuy&ecirc;n m&ocirc;n của m&igrave;nh, đ&atilde; tạo n&ecirc;n đ&oacute;ng g&oacute;p quan trọng cho một trong c&aacute;c vấn đề h&oacute;c b&uacute;a nhất khi tiến h&agrave;nh nghi&ecirc;n cứu: Ứng vi&ecirc;n v&agrave; chiến dịch của họ đ&atilde; định h&igrave;nh như thế n&agrave;o v&agrave; bị t&aacute;c động ra sao từ c&aacute;c yếu tố thuộc về cử tri?</p>\n<p>Đ&acirc;y l&agrave; điểm li&ecirc;n kết tương hỗ hai th&agrave;nh phần quan trọng nhất của đảng, l&agrave; bầu cử v&agrave; điều h&agrave;nh, v&agrave;o một khối tổng thể c&oacute; t&iacute;nh cố kết cao hơn. Nhờ thế m&agrave; b&agrave; đ&atilde; l&agrave;m r&otilde; một trong c&aacute;c vấn đề ng&agrave;y c&agrave;ng g&acirc;y hoang mang trong lĩnh vực n&agrave;y.</p>\n<p>Marjorie cũng nghi&ecirc;n cứu tường tận về vai tr&ograve; của giới t&iacute;nh trong nền ch&iacute;nh trị, kh&iacute;a cạnh ch&iacute;nh trị đảng ph&aacute;i kh&ocirc;ng chỉ đ&oacute;ng vai tr&ograve; quan trọng bấy l&acirc;u &iacute;t nhất từ việc để phụ nữ c&oacute; quyền bầu cử, m&agrave; c&ograve;n đặc biệt cấp thiết trong bối cảnh &lsquo;khoảng c&aacute;ch giới&rsquo; xuất hiện v&agrave; ng&agrave;y c&agrave;ng tăng.</p>\n<p>Cuối c&ugrave;ng, b&agrave; c&oacute; h&agrave;ng loạt đ&oacute;ng g&oacute;p gi&uacute;p ch&uacute;ng ta nắm được c&aacute;ch thức để hiểu về &yacute; nghĩa của những sự kiện phức tạp. Một điểm đặc biệt của cuốn s&aacute;ch n&agrave;y l&agrave; tăng cường sử dụng diễn giải từ c&aacute;c nh&acirc;n vật đảng cả nổi tiếng v&agrave; &iacute;t tiếng tăm, khiến cho nội dung trở n&ecirc;n sống động.</p>\n<p>Kh&ocirc;ng những mỗi t&aacute;c giả bổ sung hiểu biết ri&ecirc;ng c&oacute; v&agrave; mới mẻ của m&igrave;nh về đảng ph&aacute;i ch&iacute;nh trị khi tiếp nối v&agrave;o đội ngũ học giả h&agrave;ng đầu tạo n&ecirc;n cuốn s&aacute;ch n&agrave;y, m&agrave; mỗi ấn bản đ&atilde; tự hồi sinh khi xem x&eacute;t đời sống ch&iacute;nh trị của thời kỳ đ&oacute;.</p>\n<p>Độc giả muốn t&igrave;m hiểu về kinh tế ch&iacute;nh trị Hoa kỳ, đặc biệt l&agrave; hệ thống đảng ph&aacute;i đang tồn tại ở Hoa Kỳ kh&ocirc;ng n&ecirc;n bỏ qua t&aacute;c phẩm n&agrave;y.</p>', 'aed161ac9f3b41a780d45f6ff3923a6b.png', 'Chính Trị Đảng Phái Tại Hoa Kỳ', 300000, 20, 23, 9, 0);
INSERT INTO `book` VALUES (31, 'admin', '2023-11-27 23:38:53', 'admin', '2023-11-27 23:38:53', 'Charlotte Grossetête Sabine du Mesnil', 183500, '<h2>Combo s&aacute;ch Thưởng Ngoạn Hội Họa (2 Cuốn) gồm:<br>1. Thưởng Ngoạn Hội Họa - Kể Chuyện Về 20 Kiệt T&aacute;c Nghệ Thuật</h2>\n<h2>Những c&acirc;u chuyện thần thoại l&agrave; nguồn cảm hứng bất tận để nhiều nghệ sĩ s&aacute;ng tạo n&ecirc;n c&aacute;c t&aacute;c phẩm nghệ thuật k&igrave; vĩ v&agrave; ấn tượng.&nbsp;Thưởng Ngoạn Hội Họa &ndash; Thần Thoại Trong 20 Kiệt T&aacute;c Nghệ Thuật&nbsp;dẫn dắt bạn đọc bước v&agrave;o chuyến h&agrave;nh tr&igrave;nh kh&aacute;m ph&aacute; c&acirc;u chuyện đằng sau 20 kiệt t&aacute;c ấn tượng trong lịch sử nghệ thuật về c&aacute;c nh&acirc;n vật v&agrave; c&aacute;c vị thần nổi tiếng nhất trong thần thoại Hi Lạp.<br>Dưới b&agrave;n tay t&agrave;i hoa của những nghệ sĩ nổi tiếng như Caravaggio, Ingres, Klimit hay Matisse..., c&acirc;u chuyện của c&aacute;c thần v&agrave; anh h&ugrave;ng thần thoại hiện l&ecirc;n sống động th&ocirc;ng qua nhiều loại h&igrave;nh nghệ thuật thị gi&aacute;c (tranh vẽ, t&aacute;c phẩm đi&ecirc;u khắc, minh họa s&aacute;ch cổ, tranh khảm v&agrave; c&aacute;c đồ mĩ nghệ). Mỗi nh&acirc;n vật, từ c&aacute;c vị thần như Athena, Apollo, Aphrodite, đến c&aacute;c nh&acirc;n vật Ulysse, Narcissus, Persephone, Heracles..., đều c&oacute; c&acirc;u chuyện ri&ecirc;ng dệt n&ecirc;n từ t&igrave;nh y&ecirc;u, những cuộc chiến, thử th&aacute;ch, sự đua tranh v&agrave; vinh quang,...<br>Mời bạn c&ugrave;ng đọc&nbsp;Thưởng Ngoạn Hội Họa &ndash; Thần Thoại Trong 20 Kiệt T&aacute;c Nghệ Thuật&nbsp;v&agrave; bước v&agrave;o cuộc phi&ecirc;u lưu tuyệt diệu trong thế giới thần thoại Hi Lạp &ndash; một h&agrave;nh tr&igrave;nh kh&ocirc;ng chỉ l&ocirc;i cuốn tất cả những ai mộng mơ m&agrave; c&ograve;n cả những người đam m&ecirc; t&igrave;m hiểu về thế giới cổ đại.</h2>\n<h2>2. Thưởng Ngoạn Hội Họa - Thần Thoại Trong 20 Kiệt T&aacute;c Nghệ Thuật</h2>\n<h2>Những c&acirc;u chuyện thần thoại l&agrave; nguồn cảm hứng bất tận để nhiều nghệ sĩ s&aacute;ng tạo n&ecirc;n c&aacute;c t&aacute;c phẩm nghệ thuật k&igrave; vĩ v&agrave; ấn tượng.&nbsp;Thưởng Ngoạn Hội Họa &ndash; Thần Thoại Trong 20 Kiệt T&aacute;c Nghệ Thuật&nbsp;dẫn dắt bạn đọc bước v&agrave;o chuyến h&agrave;nh tr&igrave;nh kh&aacute;m ph&aacute; c&acirc;u chuyện đằng sau 20 kiệt t&aacute;c ấn tượng trong lịch sử nghệ thuật về c&aacute;c nh&acirc;n vật v&agrave; c&aacute;c vị thần nổi tiếng nhất trong thần thoại Hi Lạp.<br>Dưới b&agrave;n tay t&agrave;i hoa của những nghệ sĩ nổi tiếng như Caravaggio, Ingres, Klimit hay Matisse..., c&acirc;u chuyện của c&aacute;c thần v&agrave; anh h&ugrave;ng thần thoại hiện l&ecirc;n sống động th&ocirc;ng qua nhiều loại h&igrave;nh nghệ thuật thị gi&aacute;c (tranh vẽ, t&aacute;c phẩm đi&ecirc;u khắc, minh họa s&aacute;ch cổ, tranh khảm v&agrave; c&aacute;c đồ mĩ nghệ). Mỗi nh&acirc;n vật, từ c&aacute;c vị thần như Athena, Apollo, Aphrodite, đến c&aacute;c nh&acirc;n vật Ulysse, Narcissus, Persephone, Heracles..., đều c&oacute; c&acirc;u chuyện ri&ecirc;ng dệt n&ecirc;n từ t&igrave;nh y&ecirc;u, những cuộc chiến, thử th&aacute;ch, sự đua tranh v&agrave; vinh quang,...<br>Mời bạn c&ugrave;ng đọc&nbsp;Thưởng Ngoạn Hội Họa &ndash; Thần Thoại Trong 20 Kiệt T&aacute;c Nghệ Thuật v&agrave; bước v&agrave;o cuộc phi&ecirc;u lưu tuyệt diệu trong thế giới thần thoại Hi Lạp &ndash; một h&agrave;nh tr&igrave;nh kh&ocirc;ng chỉ l&ocirc;i cuốn tất cả những ai mộng mơ m&agrave; c&ograve;n cả những người đam m&ecirc; t&igrave;m hiểu về thế giới cổ đại.</h2>', 'ae6de738b6b64f208f4272eb2b40f6f0.jpg', 'Combo Thưởng Ngoạn Hội Họa (2 Cuốn)', 216000, 20, 23, 8, 0);
