INSERT INTO `book` VALUES (33, NULL, NULL, 'admin', '2023-11-27 23:47:14', 'Kristin Thompson', 150000, '<p><strong>Lịch sử điện ảnh (Film History)</strong> l&agrave; một cuốn s&aacute;ch c&ocirc;ng cụ&nbsp; - c&ocirc;ng cụ cần thiết trước hết cho những ai l&agrave;m nghề điện ảnh, những nh&agrave; nghi&ecirc;n cứu v&agrave; giảng dạy, c&aacute;c sinh vi&ecirc;n cao đẳng , đại học chuy&ecirc;n ng&agrave;nh, sau đ&oacute; l&agrave; cho những người y&ecirc;u th&iacute;ch điện ảnh muốn t&igrave;m hiểu s&acirc;u qu&aacute; tr&igrave;nh diễn tiến lịch sử của phương diện kỹ thuật trong việc l&agrave;m ra một sản phẩm điện ảnh &ndash; một bộ phim. Nh&oacute;m t&aacute;c giả Kristin Thompson v&agrave; David Bordwell, hai trong những chuy&ecirc;n gia h&agrave;nh đầu về Điện Ảnh Học tại trường đại học Wisconsin &ndash; Madison, Hoa Kỳ đ&atilde; hạn chế đến mức thấp nhất những b&igrave;nh luận x&atilde; hội học về nội dung tư tưởng một bộ phim đựoc b&agrave;n đến v&agrave; gi&agrave;nh nhiều trang cho việc khảo s&aacute;t c&aacute;c kh&iacute;a cạnh kỹ thuật của vấn đề viết kịch bản, c&aacute;ch d&agrave;n dựng, những ph&aacute;t hiện kỹ thuật &ndash; c&ocirc;ng nghệ, ph&acirc;n t&iacute;ch c&aacute;c yếu tố của l&yacute; thuyết tự sự, tr&igrave;nh b&agrave;y c&aacute;c trường ph&aacute;i l&yacute; lụ&acirc;n điện ảnh trong thế kỷ&nbsp; XX. C&aacute;ch tiếp cận lịch sử điện ảnh như thế r&otilde; r&agrave;ng l&agrave; kh&aacute; mới mẻ đối với ch&uacute;ng ta, do đ&oacute;, c&oacute; thể xem đ&acirc;y l&agrave; một cuốn s&aacute;ch bổ &iacute;ch nhiều mặt cho độc giả Việt Nam.</p>\n<p><strong>Lịch sử điện ảnh</strong> l&agrave; một c&ocirc;ng tr&igrave;nh lớn, bao qu&aacute;t h&agrave;ng ng&agrave;n bộ phim c&aacute;c loại của nhiều nước, qua nhiều giao đoạn lịch sử kh&aacute;c nhau. Để viết được c&ocirc;ng tr&igrave;nh n&agrave;y, t&aacute;c giả đ&atilde; tham khảo h&agrave;ng trăm c&ocirc;ng tr&igrave;nh nghi&ecirc;n cứu, h&agrave;ng ng&agrave;n b&agrave;i viết tr&ecirc;n c&aacute;c b&aacute;o, tạp ch&iacute; v&agrave; cũng như thế, h&agrave;ng ng&agrave;n bức ảnh được lấy trực tiếp hay gi&aacute;n tiếp từ c&aacute;c bộ phim để minh hoạ một c&aacute;ch thuyết phục cho c&ocirc;ng&nbsp; tr&igrave;nh đồ sộ n&agrave;y.</p>', '1964c575d28a4d87a55adc7e012e0aaa.jpg', 'Lịch Sử Điện Ảnh Thế Giới', 200000, 35, 15, 8, 0);
INSERT INTO `book` VALUES (34, NULL, NULL, 'admin', '2023-11-28 00:03:44', 'Joanna Turnbull', 590000, '<p>Từ điển ng&agrave;y nay rất đa dạng, phong ph&uacute; như c&aacute;c loại từ điển tường giải tiếng Anh (Anh - Anh) của c&aacute;c NXB nước ngo&agrave;i, c&aacute;c từ điển song ngữ Anh - Việt, Việt - Anh do người Việt Nam bi&ecirc;n soạn, &hellip; v&agrave; c&ugrave;ng sự ph&aacute;t triển của c&ocirc;ng nghệ, c&ograve;n c&oacute; từ điển trực tuyến được sử dụng tr&ecirc;n internet, tr&ecirc;n điện thoại v&agrave; c&aacute;c thiết bị số kh&aacute;c.</p>\n<p>Tuy nhi&ecirc;n, người học tiếng Anh tại Việt Nam từ l&acirc;u vẫn mong mỏi về một cuốn từ điển tầm cỡ để tra cứu v&agrave; thể hiện được trạng th&aacute;i của vốn từ vựng tiếng Anh hiện đại v&agrave; cả sự ph&aacute;t triển từ vựng hiện nay của tiếng Việt. Một cuốn từ điển như vậy sẽ l&agrave; c&ocirc;ng cụ đắc lực để người Việt tiếp thu th&agrave;nh tựu tri thức của thế giới.</p>\n<p>Như bạn đọc đ&atilde; biết, OALD phi&ecirc;n bản 8.0 l&agrave; từ điển b&aacute;n chạy nhất thế giới với hơn 35 triệu bản với những ưu điểm nổi bật:</p>\n<p>+ Từ điển với dung lượng đồ sộ gồm 184,500 từ, cụm từ được giải th&iacute;ch một c&aacute;ch dễ hiểu, ch&iacute;nh x&aacute;c, trong đ&oacute; c&oacute; 1.000 từ v&agrave; nghĩa mới.</p>\n<p>+ Oxford 3000 Plus với 3000 đầu mục c&aacute;c từ v&agrave; nghĩa th&ocirc;ng dụng nhất gi&uacute;p người học ph&aacute;t triển vốn từ nhanh ch&oacute;ng.</p>\n<p>+ Oxford Writing Tutor hướng dẫn người học c&aacute;ch viết nhiều thể loại văn bản trong tiếng Anh; đồng thời cũng hướng dẫn người học c&aacute;ch ph&aacute;t triển &yacute; tưởng cho b&agrave;i viết của m&igrave;nh.</p>\n<p>+ Topic Collocations, Synonym Note v&agrave; Language Bank gi&uacute;p người học chọn v&agrave; sử dụng đ&uacute;ng, đa dạng c&aacute;c từ, cụm từ v&agrave; c&aacute;c c&acirc;u trong Anh ngữ.</p>', 'de5ed36c11094eb1b444bbafb246ce46.png', 'Từ Điển Oxford Advanced Learner\'s Dictionary (With Vietnamese Translation)', 695000, 1, 15, 7, 0);
INSERT INTO `book` VALUES (35, 'admin', '2023-11-27 23:52:21', 'admin', '2023-11-27 23:52:21', 'Jane', 114500, '<p>1000 từ vựng tiếng Anh thiết yếu cho trẻ em l&agrave; cuốn s&aacute;ch hấp dẫn với h&igrave;nh ảnh minh họa trực quan, lối tr&igrave;nh b&agrave;y khoa học, gi&uacute;p c&aacute;c bạn nhỏ nhanh ch&oacute;ng mở rộng vốn từ vựng của m&igrave;nh. Qua 26 chủ đề đa dạng v&agrave; thiết thực, cuốn s&aacute;ch sẽ khiến việc học từ mới trở th&agrave;nh một c&ocirc;ng việc thật vui vẻ v&agrave; th&uacute; vị. C&aacute;c bạn đừng qu&ecirc;n qu&eacute;t m&atilde; QR ở mỗi chủ đề để nghe c&aacute;ch ph&aacute;t &acirc;m từng từ vựng nh&eacute;!</p>', '7ec7ad0b223e4ab5938b704eb509cc47.jpg', '1000 Từ Vựng Tiếng Anh Thiết Yếu Cho Trẻ Em', 135000, 38, 15, 7, 0);
INSERT INTO `book` VALUES (36, 'admin', '2023-11-28 00:07:47', 'admin', '2023-11-28 00:07:47', 'Hiếu Minh', 22000, '<p>Bộ&nbsp;<a href=\"https://bookbuy.vn/sach.html\">s&aacute;ch</a>&nbsp;<strong>Từ điển h&igrave;nh ảnh</strong><em>&nbsp;cho b&eacute;</em>&nbsp;gồm 10 cuốn, với c&aacute;c chủ đề: Chữ c&aacute;i, Số đếm, M&agrave;u sắc v&agrave; h&igrave;nh dạng, Động vật; Hoa, Tr&aacute;i c&acirc;y, Rau củ, Phương tiện, Đồ d&ugrave;ng, Đồ chơi. Mỗi chủ đề gồm 14 h&igrave;nh ảnh quen thuộc gần gũi với b&eacute; v&agrave; c&aacute;c từ tương ứng với n&oacute; (bằng cả tiếng Việt v&agrave; tiếng Anh) nhằm gi&uacute;p c&aacute;c b&eacute; từ 0-3 tuổi c&oacute; được vốn từ cần thiết, để b&eacute; c&oacute; những h&igrave;nh dung bước đầu về thế giới xung quanh; đồng thời với vốn từ nho nhỏ n&agrave;y b&eacute; sẽ biểu đạt &yacute; nghĩ của m&igrave;nh tốt hơn.</p>\n<p>Bộ s&aacute;ch c&oacute; thể coi l&agrave; những cuốn s&aacute;ch gi&aacute;o khoa đầu đời dạy b&eacute; những b&agrave;i học đầu ti&ecirc;n đơn giản m&agrave; v&ocirc; c&ugrave;ng &yacute; nghĩa; từ đ&oacute; b&eacute; c&oacute; thể tự tin trong việc thể hiện những &yacute; nghĩ của m&igrave;nh, tự tin trong giao tiếp.</p>\n<p>S&aacute;ch in tr&ecirc;n b&igrave;a cứng, h&igrave;nh ảnh tươi s&aacute;ng, vui mắt, phần từ ngữ in to dễ đọc, khu&ocirc;n khổ 125x125mm th&iacute;ch hợp vừa l&agrave;m s&aacute;ch vừa l&agrave;m đồ chơi bền bỉ cho c&aacute;c b&eacute; 0-3 tuổi.</p>', '221af025692e4e5facf9e1dc683b320f.jpg', 'Từ Điển Hình Ảnh Cho Bé: Động Vật', 26000, 25, 10, 7, 0);
