INSERT INTO `book` VALUES (42, 'admin', '2023-11-28 00:13:56', 'admin', '2023-11-28 00:13:56', 'Hartley', 12500, '<p><strong><a href=\"http://bookbuy.vn/sach/to-tim-hieu-nghe/p1\">Tớ t&igrave;m hiểu nghề</a>&nbsp;</strong>l&agrave; bộ s&aacute;ch gi&uacute;p c&aacute;c em nhỏ t&igrave;m hiểu về c&aacute;c ng&agrave;nh nghề để c&oacute; thể lựa chọn v&agrave; nu&ocirc;i dưỡng ước mơ của m&igrave;nh.<strong>&nbsp;Tớ T&igrave;m Hiểu Nghề&nbsp;Nh&agrave; Khoa Học&nbsp;</strong>chắc chắn sẽ l&agrave; một quyển s&aacute;ch gối đầu giường đầy hữu &iacute;ch của c&aacute;c em. Với c&aacute;c h&igrave;nh ảnh minh họa sống động đầy m&agrave;u sắc, c&aacute;c em sẽ c&oacute; cơ hội được tiếp x&uacute;c v&agrave; th&ecirc;m y&ecirc;u mến nghề nghi&ecirc;n cứu khoa học- những vĩ nh&acirc;n đang ng&agrave;y ng&agrave;y t&igrave;m t&ograve;i kh&aacute;m ph&aacute;, đ&oacute;ng g&oacute;p t&iacute;ch cực cho đời sống của con người.&nbsp;</p>', 'fb6c4a54c68645be991e382e73ef7473.jpg', 'Tớ Tìm Hiểu Nghề: Nhà Khoa Học', 15000, 30, 16, 6, 0);
INSERT INTO `book` VALUES (43, 'admin', '2023-11-28 00:15:12', 'admin', '2023-11-28 00:15:12', 'Mike', 114500, '<p>Nhằm cung cấp kiến thức cho những em nhỏ y&ecirc;u th&iacute;ch v&agrave; say m&ecirc; học hỏi c&aacute;c lĩnh vực khoa học, C&ocirc;ng ty Văn h&oacute;a Đ&ocirc;ng A đ&atilde; xuất bản cuốn&nbsp;<em>B&aacute;ch khoa khoa học cho trẻ em</em>. Đ&acirc;y l&agrave; kho tri thức tuyệt vời đề cập đến những chủ đề trẻ th&iacute;ch t&igrave;m hiểu như:&nbsp;<em>Con số v&agrave; h&igrave;nh dạng, Thế giới quanh ta hoạt động như thế n&agrave;o, Thế giới vật chất, Sinh vật&nbsp;</em>v&agrave;<em>&nbsp;Kh&ocirc;ng gian.</em></p>\n<p>Mỗi chủ đề l&agrave; c&aacute;c c&acirc;u chuyện khoa học th&uacute; vị được kể đơn giản gi&uacute;p trẻ dễ hiểu v&agrave; nắm bắt kho kiến thức phong ph&uacute;. Trẻ tiếp thu dễ d&agrave;ng hơn những kiến thức khoa học th&ocirc;ng qua hơn 500 minh họa m&agrave;u sống động, th&uacute; vị. Cuối mỗi chủ đề sẽ l&agrave; phần tổng kết&nbsp;<em>B&acirc;y giờ bạn đ&atilde; biết&nbsp;</em>ngắn gọn v&agrave; hữu &iacute;ch. Đặc biệt, trong mỗi chủ đề sẽ c&oacute; c&aacute;c tr&ograve; chơi s&aacute;ng tạo, hấp dẫn gi&uacute;p trẻ vừa học vừa chơi. Ngo&agrave;i ra, với c&aacute;c link internet k&egrave;m theo mỗi chủ đề, c&aacute;c em sẽ được cung cấp th&ecirc;m lượng kiến thức lớn li&ecirc;n quan.</p>\n<p><em>B&aacute;ch khoa khoa học cho trẻ em</em> được bi&ecirc;n soạn bởi Tiến sĩ Mike Goldsmith &ndash; t&aacute;c giả nổi tiếng chuy&ecirc;n viết s&aacute;ch khoa học cho thiếu nhi. Với kinh nghiệm của m&igrave;nh, t&aacute;c giả đ&atilde; viết n&ecirc;n cuốn s&aacute;ch đầy hấp dẫn, dễ hiểu v&agrave; rất th&uacute; vị. Đ&acirc;y l&agrave; cuốn s&aacute;ch kh&ocirc;ng thể thiếu d&agrave;nh cho c&aacute;c em y&ecirc;u th&iacute;ch v&agrave; muốn kh&aacute;m ph&aacute; khoa học.</p>', 'fdf8d32004694bca8757ff303e108d18.jpg', 'Bách Khoa Khoa Học Cho Trẻ Em', 135000, 50, 15, 6, 0);
INSERT INTO `book` VALUES (44, 'admin', '2023-11-28 00:16:07', 'admin', '2023-11-28 00:16:07', 'Hình Đào', 114500, '<p>Bộ s&aacute;ch \"Kh&aacute;m ph&aacute; thế giới d&agrave;nh cho thanh - thiếu ni&ecirc;n\" được bi&ecirc;n soạn cho lứa tuổi với bản t&iacute;nh đầy hiếu kỳ. Bộ s&aacute;ch tổng hợp rất nhiều sự kiện b&iacute; ẩn chưa lời giải đ&aacute;p, những hiện tượng đa dạng phức tạp, tr&ecirc;n rất nhiều lĩnh vực như thăm do Tr&aacute;i Đất, b&iacute; ẩn thể giới tự nhi&ecirc;n, b&iacute; mật ngo&agrave;i vũ trụ ... được tr&igrave;nh b&agrave;y một c&aacute;ch khoa học sẽ k&iacute;ch th&iacute;ch tr&iacute; t&ograve; m&ograve;, t&igrave;m hiểu kh&aacute;m ph&aacute; của lứa tuổi thanh - thiếu ni&ecirc;n, đồng thời những kiến thức khoa học v&agrave; tri thức nh&acirc;n văn li&ecirc;n quan được lồng gh&eacute;p trong đ&oacute; cũng gi&uacute;p c&aacute;c em biết t&igrave;m hiểu, ph&acirc;n biệt sự thực v&agrave; hư v&ocirc; bằng con mắt khoa học, từ trong qu&aacute; tr&igrave;nh ph&aacute;t hiện kh&ocirc;ng ngừng những vấn đề mới v&agrave; từng bước ph&aacute; giải những b&iacute; mật m&agrave; thu lượm tri thức, ch&agrave;o đ&oacute;n tương lai bằng niềm mong đợi v&agrave; hy vọng tr&agrave;n trề của tuổi nhỏ.</p>\n<p>Kh&aacute;m ph&aacute; thế giới d&agrave;nh cho thanh - thiếu ni&ecirc;n với những th&ocirc;ng tin khoa học chuẩn x&aacute;c, độc đ&aacute;o, mới mẻ v&agrave; đặc sắc, thực sự xuất ph&aacute;t từ t&acirc;m l&yacute; v&agrave; nhu cầu đọc s&aacute;ch, t&igrave;m hiểu tri thức của thanh - thiếu ni&ecirc;n. Th&ocirc;ng qua h&igrave;nh thức kinh điển, \"Kh&aacute;m ph&aacute; những b&iacute; ẩn về khoa học\", bộ s&aacute;ch sẽ thể hiện sự đa dạng phong ph&uacute; nhiều mầu sắc của thế giới xung quanh c&aacute;c em từ nhiều g&oacute;c độ, tạo cho ch&uacute;ng một vũ đ&agrave;i để t&igrave;m hiểu thế giới. Bộ s&aacute;ch lần lượt chọn lựa những b&iacute; ẩn rất đ&aacute;ng kinh ngạc trong t&aacute;m lĩnh vực l&agrave; Vũ Trụ, Tr&aacute;i Đất, tự nhi&ecirc;n, động vật, khủng long, qu&acirc;n sự, khoa học, nh&acirc;n loại, th&ocirc;ng tin trong mỗi chủ đề được chắt lọc từ rất nhiều tư liệu qu&yacute; gi&aacute; m&agrave; c&aacute;c nh&agrave; bi&ecirc;n soạn thu thập được. Rất nhiều những b&iacute; ẩn đang đợi chờ c&aacute;c em kh&aacute;m ph&aacute;.</p>', '5f8833f942094683935092eff60ef1e7.jpg', 'Khám Phá Những Bí Ẩn Về Khoa Học', 135000, 55, 15, 6, 0);
INSERT INTO `book` VALUES (45, NULL, NULL, 'admin', '2023-11-28 00:25:32', 'Nhiều tác giả', 34000, '<p>Em đam m&ecirc; c&ocirc;ng nghệ, th&iacute;ch lọ mọ sửa chữa, lắp r&aacute;p m&aacute;y m&oacute;c? Em c&oacute; ước mơ sau n&agrave;y trở th&agrave;nh kĩ sư? Bộ s&aacute;ch&nbsp;<strong><em>Kĩ Sư Tương Lai</em></strong>&nbsp;gồm 6 cuốn sẽ đồng h&agrave;nh c&ugrave;ng em tr&ecirc;n con đường hiện thực h&oacute;a những ước mơ đ&oacute;, bằng c&aacute;ch cung cấp những kiến thức chung về nghề kĩ sư trong từng lĩnh vực v&agrave; những dự &aacute;n thực h&agrave;nh hữu dụng.</p>\n<p>C&aacute;c kĩ sư nh&iacute; đ&atilde; sẵn s&agrave;ng t&igrave;m hiểu về c&aacute;c dạng kết cấu c&ocirc;ng tr&igrave;nh phổ biến v&agrave; bắt tay v&agrave;o thực hiện những dự &aacute;n th&uacute; vị để thiết kế một c&ocirc;ng tr&igrave;nh nh&agrave; cao tầng hay cầu đường từ giấy hoặc tăm tre trong&nbsp;<strong><em>Kĩ Sư Tương Lai &ndash; X&acirc;y Dựng V&agrave; Kết Cấu&nbsp;</em></strong>chưa? C&ugrave;ng bắt đầu ngay th&ocirc;i n&agrave;o!</p>\n<p>-------</p>\n<p>T&igrave;m đọc trọn bộ&nbsp;<strong><em>Kĩ Sư Tương Lai</em></strong>&nbsp;(6 cuốn):</p>\n<p>- X&acirc;y Dựng V&agrave; Kết Cấu</p>\n<p>- M&aacute;y M&oacute;c</p>\n<p>- Giao Th&ocirc;ng Vận Tải</p>\n<p>- Năng Lượng</p>', 'de7cd883166b4a529e643b514563b6e6.jpg', 'Kĩ Sư Tương Lai - STEM - Năng Lượng', 40000, 60, 15, 6, 0);
