INSERT INTO `book` VALUES (49, NULL, NULL, 'admin', '2023-11-28 00:23:54', 'Nhiều tác giả', 34000, '<p>Em đam m&ecirc; c&ocirc;ng nghệ, th&iacute;ch lọ mọ sửa chữa, lắp r&aacute;p m&aacute;y m&oacute;c? Em c&oacute; ước mơ sau n&agrave;y trở th&agrave;nh kĩ sư? Bộ s&aacute;ch&nbsp;<strong><em>Kĩ Sư Tương Lai</em></strong>&nbsp;gồm 6 cuốn sẽ đồng h&agrave;nh c&ugrave;ng em tr&ecirc;n con đường hiện thực h&oacute;a những ước mơ đ&oacute;, bằng c&aacute;ch cung cấp những kiến thức chung về nghề kĩ sư trong từng lĩnh vực v&agrave; những dự &aacute;n thực h&agrave;nh hữu dụng.</p>\n<p>C&aacute;c kĩ sư nh&iacute; đ&atilde; sẵn s&agrave;ng t&igrave;m hiểu về c&aacute;c dạng kết cấu c&ocirc;ng tr&igrave;nh phổ biến v&agrave; bắt tay v&agrave;o thực hiện những dự &aacute;n th&uacute; vị để thiết kế một c&ocirc;ng tr&igrave;nh nh&agrave; cao tầng hay cầu đường từ giấy hoặc tăm tre trong&nbsp;<strong><em>Kĩ Sư Tương Lai &ndash; X&acirc;y Dựng V&agrave; Kết Cấu&nbsp;</em></strong>chưa? C&ugrave;ng bắt đầu ngay th&ocirc;i n&agrave;o!</p>\n<p>-------</p>\n<p>T&igrave;m đọc trọn bộ&nbsp;<strong><em>Kĩ Sư Tương Lai</em></strong>&nbsp;(6 cuốn):</p>\n<p>- X&acirc;y Dựng V&agrave; Kết Cấu</p>\n<p>- M&aacute;y M&oacute;c</p>\n<p>- Giao Th&ocirc;ng Vận Tải</p>\n<p>- Năng Lượng</p>', '6b90183d203e4639bb92171c201c719a.jpg', 'Kĩ Sư Tương Lai - STEM - Máy Tính Và Robot', 40000, 60, 15, 6, 0);
INSERT INTO `book` VALUES (50, NULL, NULL, 'admin', '2023-11-28 00:23:35', 'Nhiều tác giả', 34000, '<p>Em đam m&ecirc; c&ocirc;ng nghệ, th&iacute;ch lọ mọ sửa chữa, lắp r&aacute;p m&aacute;y m&oacute;c? Em c&oacute; ước mơ sau n&agrave;y trở th&agrave;nh kĩ sư? Bộ s&aacute;ch&nbsp;<strong><em>Kĩ Sư Tương Lai</em></strong>&nbsp;gồm 6 cuốn sẽ đồng h&agrave;nh c&ugrave;ng em tr&ecirc;n con đường hiện thực h&oacute;a những ước mơ đ&oacute;, bằng c&aacute;ch cung cấp những kiến thức chung về nghề kĩ sư trong từng lĩnh vực v&agrave; những dự &aacute;n thực h&agrave;nh hữu dụng.</p>\n<p>C&aacute;c kĩ sư nh&iacute; đ&atilde; sẵn s&agrave;ng t&igrave;m hiểu về c&aacute;c dạng kết cấu c&ocirc;ng tr&igrave;nh phổ biến v&agrave; bắt tay v&agrave;o thực hiện những dự &aacute;n th&uacute; vị để thiết kế một c&ocirc;ng tr&igrave;nh nh&agrave; cao tầng hay cầu đường từ giấy hoặc tăm tre trong&nbsp;<strong><em>Kĩ Sư Tương Lai &ndash; X&acirc;y Dựng V&agrave; Kết Cấu&nbsp;</em></strong>chưa? C&ugrave;ng bắt đầu ngay th&ocirc;i n&agrave;o!</p>\n<p>-------</p>\n<p>T&igrave;m đọc trọn bộ&nbsp;<strong><em>Kĩ Sư Tương Lai</em></strong>&nbsp;(6 cuốn):</p>\n<p>- X&acirc;y Dựng V&agrave; Kết Cấu</p>\n<p>- M&aacute;y M&oacute;c</p>\n<p>- Giao Th&ocirc;ng Vận Tải</p>\n<p>- Năng Lượng</p>', '10ee6a935f7944a0a80bfb4b1ce30308.jpg', 'Kĩ Sư Tương Lai - STEM - Xây Dựng Và Kết Cấu', 40000, 60, 15, 6, 0);
INSERT INTO `book` VALUES (51, 'admin', '2023-11-28 00:28:23', 'admin', '2023-11-28 00:28:23', 'Norman', 78000, '<p>Thứ đắng nhất kh&ocirc;ng phải l&agrave; thuốc, m&agrave; l&agrave; sự hối hận khi nhận ra đ&atilde; qu&aacute; muộn để thay đổi lối sống.</p>\n<p>Thứ đắt nhất kh&ocirc;ng phải l&agrave; tiền bạc, m&agrave; l&agrave; thời gian tự do bạn phải đ&aacute;nh đổi để chống đỡ bệnh tật.</p>\n<p>Nh&igrave;n v&agrave;o tỷ lệ người mắc ung thư mỗi năm, nhất l&agrave; độ tuổi ng&agrave;y c&agrave;ng trẻ h&oacute;a, nhất l&agrave; khi đ&oacute; l&agrave; một người quen, người th&acirc;n của bạn, bạn c&oacute; giật m&igrave;nh kh&ocirc;ng?</p>\n<p>Nh&igrave;n ch&iacute;nh m&igrave;nh mỗi ng&agrave;y đều thiếu sức sống, chỉ đủ sức chống chọi bệnh tật v&agrave; những cảm x&uacute;c thất thường, kh&ocirc;ng thể tập trung để l&agrave;m việc, s&aacute;ng tạo, cống hiến, bạn c&oacute; thấy m&igrave;nh đang &ldquo;sống m&ograve;n&rdquo;?</p>\n<p>Thứ bạn n&ecirc;n thay đổi kh&ocirc;ng phải l&agrave; loại thuốc đắt hơn, bệnh viện tốt hơn, m&agrave; ch&iacute;nh l&agrave; LỐI SỐNG của bạn, bắt đầu từ việc ăn uống v&agrave; sinh hoạt. Bởi &ldquo;bạn l&agrave; những g&igrave; bạn ăn, mỗi thực phẩm c&oacute; một tần số ri&ecirc;ng, v&agrave; chỉ những thực phẩm mang tần số cao, gi&agrave;u &ldquo;năng lượng sống&ldquo; mới c&oacute; thể nu&ocirc;i dưỡng v&agrave; n&acirc;ng cấp cơ thể cũng như t&acirc;m tr&iacute; bạn.&nbsp;</p>\n<p>&ldquo;<em><strong>Raw vegan - sức mạnh chữa l&agrave;nh của thực vật</strong></em>&rdquo; - c&ocirc;ng tr&igrave;nh nghi&ecirc;n cứu c&ocirc;ng phu v&agrave; đầy đủ nhất của TS. Norman W. Walker về chế độ ăn thuần thực vật v&agrave; lối sống khoa học, l&agrave; cuốn s&aacute;ch m&agrave; mỗi gia đ&igrave;nh n&ecirc;n đặt trong tủ s&aacute;ch sức khỏe v&agrave; căn bếp của m&igrave;nh để nhắc nhở mỗi người:</p>\n<p>&middot; Nhận ra những lợi &iacute;ch quan trọng của chế độ ăn uống thuần thực vật trong việc chữa bệnh v&agrave; h&igrave;nh th&agrave;nh một lối sống mới đơn giản, l&agrave;nh mạnh v&agrave; vui khỏe mỗi ng&agrave;y.</p>\n<p>&middot; &ldquo;Giật m&igrave;nh&rdquo; trước những thực phẩm độc hại m&agrave; ch&uacute;ng ta đang ti&ecirc;u thụ v&agrave; loại bỏ ch&uacute;ng từ dần dần đến vĩnh viễn khỏi thực đơn.</p>\n<p>&middot; Hiểu được cơ chế hoạt động của c&aacute;c tế b&agrave;o, tuyến v&agrave; nội tạng trong cơ thể, từ đ&oacute; thiết lập lối sinh hoạt đ&uacute;ng nguy&ecirc;n l&yacute; c&acirc;n bằng v&agrave; thuận tự nhi&ecirc;n.</p>\n<p>&middot; Quan t&acirc;m đến sức khỏe tinh thần, h&igrave;nh th&agrave;nh tư duy sống trẻ,, bởi trạng th&aacute;i t&acirc;m tr&iacute; quyết định thể trạng của mỗi con người</p>\n<p>&middot; Tự kiểm chứng những kiến thức về sức khỏe, tự x&acirc;y dựng th&oacute;i quen kỷ luật v&agrave; chịu tr&aacute;ch nhiệm với ch&iacute;nh m&igrave;nh.</p>\n<p>Bạn l&agrave; người quyết định rằng bạn kh&ocirc;ng chỉ \"ổn\", m&agrave; thực sự khỏe mạnh y&ecirc;u đời, bạn kh&ocirc;ng chỉ \"tồn tại\", m&agrave; đang sống trọn từng ph&uacute;t gi&acirc;y.</p>', 'b1b919712be144adbef3246c9d65aa5d.jpg', 'Sức Mạnh Chữa Lành Của Thực Vật - Raw Vegan', 92000, 45, 15, 5, 0);
INSERT INTO `book` VALUES (52, 'admin', '2023-11-28 00:29:16', 'admin', '2023-11-28 00:29:16', 'Norman', 78000, '<p>Kh&ocirc;ng bao giờ qu&aacute; muộn để bắt đầu trẻ h&oacute;a</p>\n<p>&nbsp;</p>\n<p>Bạn ăn thế n&agrave;o th&igrave; bạn sẽ trở th&agrave;nh thế ấy. Quả đ&uacute;ng như vậy. V&agrave; bạn cảm thấy m&igrave;nh trẻ (gi&agrave;) tới mức n&agrave;o, bạn sẽ trẻ (gi&agrave;) đ&uacute;ng ở mức đ&oacute;.&nbsp;</p>\n<p>Năm th&aacute;ng chỉ l&agrave; một phương tiện đ&aacute;nh dấu c&aacute;c mốc thời gian v&agrave; chẳng hề c&oacute; ch&uacute;t li&ecirc;n hệ n&agrave;o với tuổi t&aacute;c. Một người 30 tuổi c&oacute; thể đ&atilde; gi&agrave;, v&agrave; một người 70 tuổi c&oacute; khi vẫn trẻ.&nbsp;</p>\n<p>Thể trạng hiện tại l&agrave; hệ quả trực tiếp của to&agrave;n bộ sự chăm s&oacute;c cả về mặt tinh thần v&agrave; thể chất m&agrave; cơ thể nhận được trong qu&aacute; khứ.&nbsp;</p>\n<p>T&ocirc;i muốn nhấn mạnh sự chăm s&oacute;c về TINH THẦN trước ti&ecirc;n, bởi v&igrave; trạng th&aacute;i t&acirc;m tr&iacute; đ&oacute;ng vai tr&ograve; sống c&ograve;n đối với thể trạng của mọi con người. Một người kh&ocirc;ng thể c&oacute; sức khỏe nếu anh ta cứ li&ecirc;n tục nghĩ về bệnh tật; kh&ocirc;ng thể hạnh ph&uacute;c nếu t&acirc;m tr&iacute; lu&ocirc;n bị đ&aacute;m m&acirc;y u sầu che phủ; v&agrave; kh&ocirc;ng thể trẻ trung nếu lu&ocirc;n để bản th&acirc;n bị &aacute;m ảnh bởi sự t&agrave;n ph&aacute; của tuổi gi&agrave;.&nbsp;</p>\n<p>Trẻ trung tức l&agrave; tất cả hoặc phần lớn những thuộc t&iacute;nh của tuổi trẻ, sức khỏe, năng lượng, sinh kh&iacute;, v&agrave; nụ cười thường trực đều được thể hiện qua đ&ocirc;i mắt, v&agrave;nh m&ocirc;i. Trẻ trung nghĩa l&agrave; lu&ocirc;n chan h&ograve;a, th&acirc;n &aacute;i, lịch thiệp v&agrave; h&ograve;a nh&atilde; với tất cả mọi người, kh&ocirc;ng ph&acirc;n biệt t&iacute;n ngưỡng, m&agrave;u da hay địa vị x&atilde; hội. V&agrave; trẻ trung c&ograve;n đồng nghĩa với việc lu&ocirc;n giữ cho bản th&acirc;n ở trạng th&aacute;i năng động, lu&ocirc;n c&oacute; việc g&igrave; đ&oacute; để l&agrave;m, sao cho kh&ocirc;ng một gi&acirc;y một ph&uacute;t n&agrave;o bạn cảm thấy thời gian tr&ocirc;i qua thật l&ecirc; th&ecirc;, chậm chạp.</p>\n<p>Ở kh&iacute;a cạnh tinh thần, ch&uacute;ng ta phải nỗ lực lao động để thu được hoa tr&aacute;i l&agrave; SỰ TRẺ H&Oacute;A.&nbsp;</p>\n<p>Kh&iacute;a cạnh thể chất tuy c&oacute; đơn giản hơn song lại đ&ograve;i hỏi một &yacute; ch&iacute; sắt đ&aacute; v&agrave; một l&ograve;ng ki&ecirc;n định vững như b&agrave;n thạch. Trẻ h&oacute;a về mặt thể chất tức l&agrave; t&aacute;i x&acirc;y dựng v&agrave; t&aacute;i tạo lại cơ thể. C&ocirc;ng việc n&agrave;y thoạt ti&ecirc;n tưởng chừng qu&aacute; đỗi đơn giản nhưng tr&ecirc;n thực tế lại đ&ograve;i hỏi rất nhiều thời gian c&ugrave;ng một l&ograve;ng ki&ecirc;n nhẫn v&agrave; &yacute; ch&iacute; sắt đ&aacute;.&nbsp;</p>\n<p>Đa số mọi người khi bước qua tuổi 30, rồi 40, v&agrave; 50, đều rất dễ thốt ra những c&acirc;u đại loại như: &ldquo;Ước g&igrave; t&ocirc;i n&iacute;u giữ được tuổi xu&acirc;n&hellip; Ước g&igrave; t&ocirc;i c&oacute; thể trẻ ra &iacute;t nhất v&agrave;i tuổi&hellip; Ước g&igrave; chỗ nếp nhăn kia biến mất&hellip; Ước g&igrave; da t&ocirc;i kh&ocirc;ng chảy xệ&hellip; Ước g&igrave;&hellip;&rdquo;</p>\n<p>V&acirc;ng, cứ như thế, ch&uacute;ng ta ước, rồi lại ước v&agrave; ước, cho đến một l&uacute;c, ch&uacute;ng ta hoảng sợ v&agrave; nh&aacute;o nh&agrave;o t&igrave;m đến những phương tiện nh&acirc;n tạo h&ograve;ng giấu đi &ldquo;sự t&agrave;n ph&aacute; của tuổi t&aacute;c&rdquo;. Những phương tiện ấy c&oacute; thể gi&uacute;p ch&uacute;ng ta tự đ&aacute;nh lừa bản th&acirc;n trong ph&uacute;t chốc nhưng sẽ kh&ocirc;ng bao giờ che nổi con mắt của thi&ecirc;n hạ.&nbsp;</p>\n<p>TRẺ H&Oacute;A c&oacute; phải l&agrave; mơ ước của bạn? BẠN, v&agrave; chỉ bạn, mới c&oacute; thể biến điều đ&oacute; th&agrave;nh sự thực. TRẺ H&Oacute;A kh&ocirc;ng phải l&agrave; một điều b&iacute; ẩn, m&agrave; l&agrave; một lẽ thường t&igrave;nh v&agrave; một qu&aacute; tr&igrave;nh tự huấn luyện, tự kỷ luật cực k&igrave; nghi&ecirc;m ngặt.&nbsp;</p>\n<p>TRẺ H&Oacute;A phải đi đ&ocirc;i với KHỎE MẠNH. Khỏe mạnh kh&ocirc;ng chỉ đơn thuần l&agrave; &ldquo;cảm thấy ổn&rdquo;, m&agrave; khỏe mạnh c&oacute; nghĩa l&agrave; bạn nhận biết v&agrave; hiểu r&otilde; từng bộ phận trong cơ thể m&igrave;nh hệt như một chuy&ecirc;n gia &ocirc; t&ocirc; thuộc nằm l&ograve;ng cấu tạo của chiếc &ocirc; t&ocirc; đến từng con ốc v&iacute;t.&nbsp;</p>\n<p>Bạn c&oacute; biết V&Igrave; SAO bạn phải ăn v&agrave; uống? Sự kh&aacute;c nhau giữa thực phẩm v&agrave; DINH DƯỠNG l&agrave; g&igrave;? Điều g&igrave; diễn ra trong cơ thể bạn khi bạn đang ăn v&agrave; trong h&agrave;ng tiếng đồng hồ sau khi ăn xong?&nbsp;</p>\n<p>Bạn c&oacute; biết V&Igrave; SAO bạn thở? Điều g&igrave; xảy ra khi bạn h&iacute;t kh&ocirc;ng kh&iacute; v&agrave;o phổi? V&agrave; c&aacute;i g&igrave; đang diễn ra mỗi khi bạn đẩy một luồng kh&iacute; ra khỏi phổi của m&igrave;nh?</p>\n<p>Bạn c&oacute; biết V&Igrave; SAO bạn cần ngủ v&agrave; nghỉ ngơi? Bạn c&oacute; biết V&Igrave; SAO cơ thể phải đ&agrave;o thải c&aacute;c chất cặn b&atilde;? N&oacute; l&agrave;m c&ocirc;ng việc đ&oacute; BẰNG C&Aacute;CH N&Agrave;O? V&agrave; điều g&igrave; sẽ xảy ra khi chất thải KH&Ocirc;NG ĐƯỢC loại bỏ khỏi cơ thể bạn? Bạn đ&atilde; bao giờ cảm thấy mệt mỏi, kiệt sức? Đ&acirc;u l&agrave; nguy&ecirc;n nh&acirc;n dẫn đến cảm gi&aacute;c đ&oacute;? Bạn đ&atilde; bao giờ bị đau đầu chưa? C&aacute;i g&igrave; đ&atilde; tạo ra vấn đề đ&oacute;? Bạn c&oacute; biết aspirin v&agrave; những sản phẩm tương tự th&uacute;c đẩy sự l&atilde;o h&oacute;a nhanh tới mức n&agrave;o kh&ocirc;ng? Bạn c&oacute; đang khổ sở với c&aacute;c b&uacute;i trĩ? Đ&acirc;u l&agrave; nguồn cơn của những khốn khổ ấy? Bạn c&oacute; biết rằng ch&uacute;ng kh&ocirc;ng chỉ ảnh hưởng tới to&agrave;n cơ thể m&agrave; c&ograve;n t&aacute;c động tới cả tinh thần của bạn? Bạn c&oacute; biết rằng việc d&ugrave;ng phẫu thuật hoặc kim điện tử để cắt bỏ b&uacute;i trĩ chỉ c&agrave;ng khiến những điều kiện tạo ra ch&uacute;ng trở n&ecirc;n trầm trọng th&ecirc;m, v&agrave; rất c&oacute; thể chỉ trong v&ograve;ng 1&ndash;2 năm sau đ&oacute;, ch&uacute;ng sẽ xuất hiện trở lại? Bạn c&oacute; đang gặp vấn đề với c&aacute;c chứng tim mạch? Bạn c&oacute; biết hầu hết c&aacute;c bệnh được cho l&agrave; li&ecirc;n quan đến tim CHƯA CHẮC đ&atilde; xuất ph&aacute;t từ c&aacute;c vấn đề ở tim m&agrave; l&agrave; từ một bộ phận rất dễ điều chỉnh kh&aacute;c? V&agrave; bạn c&oacute; biết, những vấn đề như vậy thường l&agrave; hậu quả của việc ti&ecirc;u thụ một số loại thực phẩm nhất định?</p>\n<p>Bạn c&oacute; tin rằng tất cả những quảng c&aacute;o về thực phẩm v&agrave; biện ph&aacute;p điều trị m&agrave; bạn đọc hoặc nghe qua đ&agrave;i ph&aacute;t thanh đều đ&uacute;ng sự thật v&agrave; hữu &iacute;ch? Nếu quả vậy th&igrave; bạn đ&atilde; lầm to! Ch&uacute;ng phần lớn chỉ dựa tr&ecirc;n những sự thật nửa vời v&agrave; những điều giả dối. Đa số c&aacute;c thực phẩm được quảng c&aacute;o rầm rộ, đặc biệt l&agrave; thực phẩm chứa tinh bột v&agrave; bột m&igrave;, đều l&agrave; trợ thủ đắc lực đẩy nhanh tốc độ l&atilde;o h&oacute;a; c&ograve;n phần lớn những biện ph&aacute;p điều trị được tung h&ocirc; hết lời kia đều g&oacute;p phần r&uacute;t ngắn thời gian sống của ch&uacute;ng ta. H&atilde;y học c&aacute;ch ph&acirc;n biệt đ&uacute;ng sai. Để TRẺ H&Oacute;A, ch&uacute;ng ta phải c&oacute; NĂNG LƯỢNG. Muốn vậy, ch&uacute;ng ta phải nghi&ecirc;n cứu v&agrave; thực h&agrave;nh những nguy&ecirc;n tắc cơ bản nhằm sản sinh v&agrave; bảo tồn năng lượng.&nbsp;</p>\n<p>Bạn c&oacute; lo &acirc;u v&agrave; phiền n&atilde;o về những vấn đề m&agrave; m&igrave;nh kh&ocirc;ng c&oacute; khả năng kiểm so&aacute;t? Bạn c&oacute; biết, những phiền n&atilde;o v&agrave; lo &acirc;u ấy sẽ khiến nguồn năng lượng m&agrave; bạn d&agrave;y c&ocirc;ng t&iacute;ch lũy ti&ecirc;u tan nhanh ch&oacute;ng? V&agrave; bạn c&oacute; biết, đ&acirc;y l&agrave; một trong những kẻ th&ugrave; lớn nhất của tuổi thanh xu&acirc;n?</p>\n<p>Bạn c&oacute; thường lao v&agrave;o c&ocirc;ng việc m&agrave; kh&ocirc;ng cần lượng trước sức m&igrave;nh, cứ l&agrave;m miệt m&agrave;i m&agrave; kh&ocirc;ng đếm xỉa g&igrave; đến việc nghỉ ngơi? Bạn c&oacute; hiểu rằng l&agrave;m như vậy tức l&agrave; bạn đang ti&ecirc;u x&agrave;i phung ph&iacute; năng lượng của m&igrave;nh theo đ&uacute;ng nghĩa đen, v&agrave; c&aacute;i gi&aacute; phải trả sẽ l&agrave; cả tuổi thanh xu&acirc;n lẫn hiệu suất lao động?</p>', 'de93600702fb4b279eb6d8b49485ad4d.jpg', 'Sống Lành Để Trẻ', 92000, 30, 15, 5, 0);
INSERT INTO `book` VALUES (53, 'admin', '2023-11-28 00:30:35', 'admin', '2023-11-28 00:30:35', 'Norman W. Walker', 78000, '<p>Chất lượng thực phẩm v&agrave; sự ph&ugrave; hợp giữa thực phẩm với nhu cầu cơ thể l&agrave; hai yếu tố mang t&iacute;nh quyết định đối với cơ thể con người. Trong hai thế kỷ trở lại đ&acirc;y, ch&uacute;ng ta mới bắt đầu nhận ra ch&acirc;n l&yacute; n&agrave;y. Những b&iacute; mật về cơ chế hoạt động của bộ m&aacute;y cơ thể người c&ugrave;ng c&aacute;ch thức n&oacute; sử dụng c&aacute;c vitamin v&agrave; kho&aacute;ng chất trong thực phẩm đang dần được đưa ra &aacute;nh s&aacute;ng.</p>\n<p>Những th&agrave;nh quả phục hồi sức khỏe khỏi hầu hết mọi loại bệnh tật v&agrave; sự x&aacute;o trộn ở cơ thể người gần như đ&atilde; trở th&agrave;nh một hiện tượng tr&ecirc;n to&agrave;n thế giới n&oacute;i chung v&agrave; trong lĩnh vực Trị liệu bằng Nước &eacute;p rau quả n&oacute;i ri&ecirc;ng. Trong thời đại ng&agrave;y nay, đ&aacute;ng tiếc thay cho người n&agrave;o c&ograve;n chưa được cung cấp đầy đủ th&ocirc;ng tin về những gi&aacute; trị dinh dưỡng v&agrave; c&ocirc;ng năng chữa l&agrave;nh của nước &eacute;p rau quả tươi sống.</p>\n<p>Kể từ khi bước sang thế kỷ 20, loại nước &eacute;p n&agrave;y đ&atilde; bắt đầu chứng tỏ được t&iacute;nh hiệu quả. Tất cả mọi người, d&ugrave; trong hay ngo&agrave;i giới khoa học, nếu thường xuy&ecirc;n cập nhật th&ocirc;ng tin chắc chắn đều sẽ c&ocirc;ng nhận gi&aacute; trị của n&oacute;. Sở dĩ liệu ph&aacute;p n&agrave;y c&oacute; thể mang lại hiệu quả cao như vậy l&agrave; v&igrave; nhờ t&aacute;ch to&agrave;n bộ lượng nước v&agrave; c&aacute;c nguy&ecirc;n tố kho&aacute;ng ra khỏi chất xơ thực phẩm, những m&oacute;n thực phẩm dạng lỏng n&agrave;y được cơ thể người ti&ecirc;u h&oacute;a chỉ trong v&agrave;i ph&uacute;t. Trong khi đ&oacute;, bộ m&aacute;y ti&ecirc;u h&oacute;a th&ocirc;ng thường sẽ phải ti&ecirc;u tốn rất nhiều c&ocirc;ng sức, với tổng thời gian l&ecirc;n tới nhiều giờ đồng hồ, mới c&oacute; thể t&aacute;ch c&aacute;c nguy&ecirc;n tố kho&aacute;ng khỏi chất xơ để cung cấp cho c&aacute;c cơ quan ti&ecirc;u h&oacute;a. Để ti&ecirc;u h&oacute;a hết to&agrave;n bộ chỗ rau quả trong dạ d&agrave;y, bộ m&aacute;y ti&ecirc;u h&oacute;a sẽ phải huy động rất nhiều năng lượng, trong khi nguồn cung cấp chỗ năng lượng ấy lại đến từ thực phẩm. Như vậy, khi bạn ti&ecirc;u thụ một lượng thức ăn &ldquo;đặc&rdquo;, th&igrave; thay v&igrave; được d&ugrave;ng để nu&ocirc;i dưỡng cơ thể bạn, ch&uacute;ng lại trở th&agrave;nh nhi&ecirc;n liệu để tạo ra năng lượng ti&ecirc;u h&oacute;a ch&iacute;nh bản th&acirc;n ch&uacute;ng.</p>\n<p>Những ph&acirc;n t&iacute;ch tr&ecirc;n đ&acirc;y sẽ gi&uacute;p bạn t&igrave;m ra lời giải đ&aacute;p cho một c&acirc;u hỏi kh&aacute; phổ biến: Tại sao phải &eacute;p rau quả lấy nước m&agrave; kh&ocirc;ng ăn ch&uacute;ng ở dạng TH&Ocirc;? Tr&ecirc;n thực tế, trong chất xơ kh&ocirc;ng hề c&oacute; dinh dưỡng. Tuy nhi&ecirc;n, ch&uacute;ng lại l&agrave; trợ thủ đắc lực để phục vụ một mục đ&iacute;ch thiết yếu v&agrave; hữu &iacute;ch kh&aacute;c. Ở trong ruột, chất xơ hoạt động như một c&acirc;y chổi. Sau khi đi qua dạ d&agrave;y, t&aacute; tr&agrave;ng v&agrave; gần 7,62m d&agrave;i ruột non, c&aacute;c mảnh chất xơ sẽ đi v&agrave;o đại tr&agrave;ng ở dạng chất xen-lu-l&ocirc; cực nhỏ. Lượng xen-lu-l&ocirc; ấy vẫn được đại tr&agrave;ng coi l&agrave; chất xơ v&agrave; sử dụng đ&uacute;ng theo mục đ&iacute;ch của n&oacute;. Kh&ocirc;ng c&oacute; chất xơ, đại tr&agrave;ng n&oacute;i ri&ecirc;ng v&agrave; to&agrave;n bộ cơ thể n&oacute;i chung kh&ocirc;ng thể đảm bảo được trạng th&aacute;i khỏe mạnh.</p>\n<p>Để đ&aacute;p ứng đ&ocirc;ng đảo y&ecirc;u cầu của những độc giả muốn biết th&ecirc;m th&ocirc;ng tin về th&agrave;nh phần kho&aacute;ng chất của thực phẩm, ch&uacute;ng t&ocirc;i đ&atilde; đưa th&ecirc;m phần Phụ lục v&agrave;o ấn phẩm n&agrave;y, trong đ&oacute; tr&igrave;nh b&agrave;y bảng ph&acirc;n t&iacute;ch th&agrave;nh phần của những loại thực phẩm phổ biến v&agrave; quen thuộc nhất.</p>\n<p>C&oacute; một điều m&agrave; t&ocirc;i cần nhấn mạnh, đ&oacute; l&agrave; ngay cả khi &aacute;p dụng biện ph&aacute;p canh t&aacute;c hữu cơ, ch&uacute;ng ta vẫn gần như kh&ocirc;ng thể tạo ra những sản phẩm ho&agrave;n hảo d&ugrave; ch&uacute;ng được trồng từ loại hạt giống n&agrave;o chăng nữa. Đ&oacute; l&agrave; v&igrave; qu&aacute; tr&igrave;nh sinh trưởng của thực vật thường chịu ảnh hưởng của rất nhiều yếu tố, m&agrave; những yếu tố ấy lại biến đổi, c&oacute; khi ho&agrave;n to&agrave;n kh&aacute;c hẳn, theo từng thửa đất.</p>\n<p>B&ecirc;n cạnh đ&oacute;, hầu như mọi rau quả ng&agrave;y nay đều c&oacute; dăm bảy loại giống kh&aacute;c nhau. Chẳng hạn, ở Mỹ hiện c&oacute; những giống c&agrave; rốt sau: c&agrave; rốt Ho&agrave;ng đế, c&agrave; rốt Chantenay, c&agrave; rốt Danvers, c&agrave; rốt Tr&aacute;i tim. Tuy c&oacute; sự sai kh&aacute;c nhỏ về th&agrave;nh phần kho&aacute;ng chất, song ch&uacute;ng mang những đặc điểm chung nhất định n&ecirc;n vẫn được xếp v&agrave;o họ c&agrave; rốt. C&aacute;c loại rau kh&aacute;c cũng tương tự như vậy.</p>\n<p>Qu&aacute; tr&igrave;nh sinh trưởng của c&acirc;y trồng phụ thuộc v&agrave;o rất nhiều yếu tố như đất, kh&iacute; hậu, vị tr&iacute; địa l&yacute; v&agrave; biện ph&aacute;p canh t&aacute;c, do đ&oacute; ch&uacute;ng ta phải sử dụng những th&ocirc;ng tin ph&acirc;n t&iacute;ch thực phẩm l&agrave;m hướng dẫn chung.</p>\n<p>Việc sử dụng kết hợp nhiều loại rau đa dạng sẽ đảm bảo cung cấp cho cơ thể ch&uacute;ng ta tất cả những vitamin v&agrave; kho&aacute;ng chất cần thiết.&nbsp;</p>\n<p>Thực phẩm canh t&aacute;c hữu cơ thường c&oacute; chất lượng vượt trội hơn so với c&aacute;c loại kh&aacute;c, nhưng thật kh&ocirc;ng may, rất hiếm khi ch&uacute;ng ta c&oacute; thể mua được loại sản phẩm n&agrave;y. Tin tưởng m&ugrave; qu&aacute;ng v&agrave;o chất lượng của những thực phẩm m&agrave; ch&uacute;ng ta mua trong c&aacute;c si&ecirc;u thị cũng l&agrave; một điều sai lầm. Với những người đ&atilde; nhận thức qu&aacute; s&acirc;u sắc về vấn đề n&agrave;y, th&igrave; c&oacute; lẽ tốt hơn hết l&agrave; n&ecirc;n chuyển về những v&ugrave;ng qu&ecirc; nơi con người vẫn tự trồng lấy thức ăn.&nbsp;</p>\n<p>Nh&igrave;n chung, nếu kh&ocirc;ng thể mua được ch&iacute;nh x&aacute;c loại thực phẩm đ&uacute;ng như &yacute; muốn th&igrave; nếu cảm thấy cần thiết, bạn h&atilde;y cứ cố gắng tận dụng triệt để những thứ C&Oacute; SẴN. D&ugrave; l&agrave; thực phẩm d&ugrave;ng cho m&oacute;n xa-l&aacute;t hay nước &eacute;p, th&igrave; c&oacute; một quy tắc bạn cần ghi nhớ: lu&ocirc;n lu&ocirc;n chọn những thực phẩm tươi nhất với chất lượng hảo hạng nhất trong điều kiện cho ph&eacute;p.</p>\n<p>CƠ THỂ BẠN ĐANG THIẾU G&Igrave;?&nbsp;</p>\n<p>T&ocirc;i lu&ocirc;n biết rằng nếu m&igrave;nh kh&ocirc;ng uống đủ lượng nước &eacute;p rau tươi sống th&igrave; cơ thể sẽ c&oacute; nguy cơ bị thiếu lượng enzyme bổ dưỡng cần thiết.</p>\n<p>C&ograve;n bạn th&igrave; sao?&nbsp;</p>\n<p>Bạn chăm s&oacute;c cơ thể m&igrave;nh như thế n&agrave;o, bạn sẽ nhận được những hệ quả như thế ấy. Tr&aacute;ch nhiệm ho&agrave;n to&agrave;n thuộc về một m&igrave;nh bạn. V&agrave; yếu tố then chốt ở đ&acirc;y ch&iacute;nh l&agrave; LỰC SỐNG trong đồ ăn thức uống hằng ng&agrave;y của bạn.&nbsp;</p>\n<p>Cơ thể bạn được tạo n&ecirc;n từ h&agrave;ng triệu tế b&agrave;o cực nhỏ. Ch&uacute;ng ch&iacute;nh l&agrave; yếu tố quyết định to&agrave;n bộ sự sống của bạn. Ch&uacute;ng cần được nu&ocirc;i dưỡng bằng nguồn dưỡng chất năng động v&agrave; dồi d&agrave;o lực sống. Thực phẩm bạn ti&ecirc;u thụ sẽ bồi bổ cơ thể bạn hay đẩy n&oacute; v&agrave;o t&igrave;nh trạng suy dinh dưỡng, tất cả đều phụ thuộc ở ch&iacute;nh bạn!</p>\n<p>Ch&uacute;ng ta c&ugrave;ng t&igrave;m kiếm c&acirc;u trả lời trong cuốn s&aacute;ch<strong><em>&nbsp;&ldquo;Ăn xanh để khỏe&rdquo;&nbsp;</em></strong>của t&aacute;c giả Norman W. Walker</p>', 'd20d5a536805402bb6b005997ec76139.jpg', 'Ăn Xanh Để Khỏe', 92000, 50, 15, 5, 0);
INSERT INTO `book` VALUES (54, 'admin', '2023-11-28 00:32:53', 'admin', '2023-11-28 00:32:53', 'Trần Bích Hà', 50000, '<p>Một cuốn s&aacute;ch với rất nhiều phương ph&aacute;p chăm s&oacute;c sức khỏe, ph&ograve;ng chữa bệnh theo c&aacute;ch tự nhi&ecirc;n, m&agrave; t&aacute;c giả cuốn s&aacute;ch đ&atilde; tự m&igrave;nh t&igrave;m t&ograve;i, trải nghiệm, &aacute;p dụng cho bản th&acirc;n, gia đ&igrave;nh, bạn b&egrave; trong suốt hơn 15 năm qua.</p>\n<p>&nbsp;</p>\n<p>&ldquo;Nhưng th&ocirc;ng điệp quan trọng nhất của cuốn s&aacute;ch n&agrave;y c&oacute; lẽ kh&ocirc;ng phải l&agrave; những c&ocirc;ng thức hay phương ph&aacute;p cụ thể, bởi mỗi phương ph&aacute;p c&oacute; thể c&oacute; t&aacute;c dụng tốt với một số người, nhưng chưa chắc đ&atilde; ph&ugrave; hợp với người kh&aacute;c. Điều thu nhận qu&yacute; gi&aacute; từ những trang s&aacute;ch của t&aacute;c giả l&agrave; niềm tin v&agrave;o khả năng của mỗi con người l&agrave;m chủ sức khỏe của m&igrave;nh. Nếu ta c&oacute; l&ograve;ng tin v&agrave; quyết t&acirc;m t&igrave;m t&ograve;i th&igrave; những bệnh m&atilde;n t&iacute;nh sẽ được chế ngự ở mức độ n&agrave;y hay mức độ kh&aacute;c. Ưu điểm tuyệt đối của những biện ph&aacute;p tự nhi&ecirc;n l&agrave; nếu kh&ocirc;ng lạm dụng th&igrave; ch&uacute;ng kh&ocirc;ng g&acirc;y hại th&ecirc;m cho cơ thể bạn. Nếu muốn cải thiện t&igrave;nh trạng sức khỏe của m&igrave;nh, bạn h&atilde;y l&ecirc;n đường thử nghiệm y học thay thế. Cuốn s&aacute;ch sẽ khơi gợi &yacute; tưởng v&agrave; tạo động lực, h&atilde;y d&ugrave;ng n&oacute; như hướng dẫn khởi h&agrave;nh. Nhưng để đến đ&iacute;ch hay kh&ocirc;ng ho&agrave;n to&agrave;n phụ thuộc v&agrave;o độ ki&ecirc;n tr&igrave; của &yacute; ch&iacute; v&agrave; sức dẻo dai của đ&ocirc;i ch&acirc;n bạn. V&agrave; như t&ocirc;i vẫn thường l&agrave;m &ndash; nếu băn khoăn hay thắc mắc, h&atilde;y hỏi t&aacute;c giả Trần B&iacute;ch H&agrave;.&rdquo; (tr&iacute;ch lời anh Nguyễn Hải, Chủ tịch HĐQT C&ocirc;ng ty Du lịch TransViet).</p>', 'f590713c1a21486c890ceb2b9f0048a4.jpg', 'Sức Khỏe Trong Tay Bạn', 60000, 59, 10, 5, 0);
INSERT INTO `book` VALUES (55, 'admin', '2023-11-28 00:33:49', 'admin', '2023-11-28 00:33:49', 'Trần Bích Hà', 50000, '<p>Một cuốn s&aacute;ch với rất nhiều phương ph&aacute;p chăm s&oacute;c sức khỏe, ph&ograve;ng chữa bệnh theo c&aacute;ch tự nhi&ecirc;n, m&agrave; t&aacute;c giả cuốn s&aacute;ch đ&atilde; tự m&igrave;nh t&igrave;m t&ograve;i, trải nghiệm, &aacute;p dụng cho bản th&acirc;n, gia đ&igrave;nh, bạn b&egrave; trong suốt hơn 15 năm qua.</p>\n<p>&nbsp;</p>\n<p>&ldquo;Nhưng th&ocirc;ng điệp quan trọng nhất của cuốn s&aacute;ch n&agrave;y c&oacute; lẽ kh&ocirc;ng phải l&agrave; những c&ocirc;ng thức hay phương ph&aacute;p cụ thể, bởi mỗi phương ph&aacute;p c&oacute; thể c&oacute; t&aacute;c dụng tốt với một số người, nhưng chưa chắc đ&atilde; ph&ugrave; hợp với người kh&aacute;c. Điều thu nhận qu&yacute; gi&aacute; từ những trang s&aacute;ch của t&aacute;c giả l&agrave; niềm tin v&agrave;o khả năng của mỗi con người l&agrave;m chủ sức khỏe của m&igrave;nh. Nếu ta c&oacute; l&ograve;ng tin v&agrave; quyết t&acirc;m t&igrave;m t&ograve;i th&igrave; những bệnh m&atilde;n t&iacute;nh sẽ được chế ngự ở mức độ n&agrave;y hay mức độ kh&aacute;c. Ưu điểm tuyệt đối của những biện ph&aacute;p tự nhi&ecirc;n l&agrave; nếu kh&ocirc;ng lạm dụng th&igrave; ch&uacute;ng kh&ocirc;ng g&acirc;y hại th&ecirc;m cho cơ thể bạn. Nếu muốn cải thiện t&igrave;nh trạng sức khỏe của m&igrave;nh, bạn h&atilde;y l&ecirc;n đường thử nghiệm y học thay thế. Cuốn s&aacute;ch sẽ khơi gợi &yacute; tưởng v&agrave; tạo động lực, h&atilde;y d&ugrave;ng n&oacute; như hướng dẫn khởi h&agrave;nh. Nhưng để đến đ&iacute;ch hay kh&ocirc;ng ho&agrave;n to&agrave;n phụ thuộc v&agrave;o độ ki&ecirc;n tr&igrave; của &yacute; ch&iacute; v&agrave; sức dẻo dai của đ&ocirc;i ch&acirc;n bạn. V&agrave; như t&ocirc;i vẫn thường l&agrave;m &ndash; nếu băn khoăn hay thắc mắc, h&atilde;y hỏi t&aacute;c giả Trần B&iacute;ch H&agrave;.&rdquo; (tr&iacute;ch lời anh Nguyễn Hải, Chủ tịch HĐQT C&ocirc;ng ty Du lịch TransViet).</p>', '790c46146e8545f79a5f6978f9ec0a19.jpg', 'Sức Khỏe Trong Tay Bạn - Tập 2', 60000, 60, 10, 5, 0);
INSERT INTO `book` VALUES (56, 'admin', '2023-11-28 00:35:10', 'admin', '2023-11-28 00:35:10', 'Trần Bích Hà', 123000, '<p>Chăm s&oacute;c sức khỏe cho ch&iacute;nh bản th&acirc;n v&agrave; những th&agrave;nh vi&ecirc;n th&acirc;n y&ecirc;u trong gia đ&igrave;nh ng&agrave;y c&agrave;ng trở th&agrave;nh một nhu cầu thiết yếu trong cuộc sống hiện đại. Tuy nhi&ecirc;n, kh&ocirc;ng phải ai cũng c&oacute; thể dễ d&agrave;ng tiếp cận v&agrave; c&oacute; thời gian t&igrave;m hiểu th&ocirc;ng tin về c&aacute;c phương ph&aacute;p chăm s&oacute;c sức khỏe ti&ecirc;n tiến tr&ecirc;n thế giới; nhất l&agrave; c&aacute;c phương ph&aacute;p c&oacute; nguồn gốc tự nhi&ecirc;n, ph&ograve;ng v&agrave; trị một số bệnh kh&ocirc;ng sử dụng thuốc. Với một t&acirc;m huyết lớn: lan tỏa những kiến thức v&agrave; hiểu biết về chăm s&oacute;c sức khỏe cho cộng đồng, c&aacute;c t&aacute;c giả của cuốn s&aacute;ch n&agrave;y: chị Trần B&iacute;ch H&agrave;, anh Nguyễn Hải, c&ugrave;ng c&aacute;c cộng sự&hellip; mong muốn cho ra đời một cuốn cẩm nang thật dễ đọc, dễ hiểu, dễ &aacute;p dụng về c&aacute;c phương ph&aacute;p thải độc chăm s&oacute;c cơ thể</p>\n<p>Cuốn s&aacute;ch bạn đang cầm tr&ecirc;n tay chỉ khoảng 200 trang giấy, nhưng đ&oacute; l&agrave; kết quả chắt lọc của hơn 10 năm đọc, t&igrave;m hiểu chuy&ecirc;n s&acirc;u từ c&aacute;c nguồn t&agrave;i liệu v&ocirc; c&ugrave;ng phong ph&uacute;, v&agrave; quan trọng l&agrave; những thử nghiệm v&agrave; kinh nghiệm tổng hợp của chị Trần B&iacute;ch H&agrave; trong qu&aacute; tr&igrave;nh t&igrave;m kiếm v&agrave; chữa trị bệnh cho ch&iacute;nh bản th&acirc;n v&agrave; gia đ&igrave;nh. Điều đặc biệt nhất l&agrave; c&aacute;c phương ph&aacute;p chăm s&oacute;c sức khỏe n&agrave;y đ&atilde; được chị Trần B&iacute;ch H&agrave; t&oacute;m lược v&agrave; đơn giản h&oacute;a</p>\n<p>để ph&ugrave; hợp v&agrave; dễ &aacute;p dụng với điều kiện thực tiễn cuộc sống của người d&acirc;n Việt Nam. D&ugrave; bạn ở miền n&uacute;i hay đồng bằng, miền khỏe tự nhi&ecirc;n c&oacute; trong cuốn s&aacute;ch n&agrave;y, bạn sẽ dễ d&agrave;ng thực hiện v&agrave; &aacute;p dụng được ngay, chứ kh&ocirc;ng chỉ l&agrave; đọc cho biết.</p>\n<p>Với một kết cấu khoa học v&agrave; hợp l&yacute;, cuốn s&aacute;ch tiết kiệm tối đa thời gian cho người đọc trong việc t&igrave;m kiếm những th&ocirc;ng tin</p>\n<p>Phần 1: C&Aacute;C PHƯƠNG PH&Aacute;P THẢI ĐỘC &ndash; Bạn sẽ dễ d&agrave;ng t&igrave;m được những hướng dẫn cần thiết để thực hiện lần lượt c&aacute;c phương ph&aacute;p thải độc cơ thể, từ khoang mũi, cho tới hệ ti&ecirc;u h&oacute;a, tẩy nấm, tẩy sỏi gan mật v&agrave; kết th&uacute;c ở thải độc thận. C&aacute;c b&agrave;i được viết dưới dạng c&ocirc;ng thức, chỉ r&otilde; từng bước cần chuẩn bị v&agrave; c&aacute;ch thức thực hiện; v&igrave; vậy c&aacute;c phương ph&aacute;p đều trở n&ecirc;n hết sức đơn</p>\n<p>Phần 2: CHẾ ĐỘ DINH DƯỠNG L&Agrave;NH MẠNH &ndash; Tiết lộ những chia sẻ v&ocirc; c&ugrave;ng gi&aacute; trị về việc duy tr&igrave; một chế độ dinh dưỡng l&agrave;nh mạnh, ph&ugrave; hợp với mục ti&ecirc;u của mỗi c&aacute; nh&acirc;n v&agrave; gia đ&igrave;nh. Lựa chọn chế độ ăn ph&ugrave; hợp l&agrave; điều then chốt quyết định</p>\n<p>Phần 3: TƯ LIỆU THAM KHẢO &ndash; Nếu bạn l&agrave; người th&iacute;ch t&igrave;m hiểu chuy&ecirc;n s&acirc;u hơn về c&aacute;c phương ph&aacute;p chăm s&oacute;c sức khỏe tự nhi&ecirc;n v&agrave; thải độc, th&igrave; đ&acirc;y ch&iacute;nh l&agrave; phần d&agrave;nh ri&ecirc;ng cho bạn.</p>', '8ad2fa4119944b28809e82b968b44b8e.png', 'Cẩm Nang Hướng Dẫn Thải Độc & Chế Độ Ăn Uống Lành Mạnh', 145000, 65, 15, 5, 0);
INSERT INTO `book` VALUES (57, 'admin', '2023-11-28 00:36:14', 'admin', '2023-11-28 00:36:15', 'Trần Doãn Hưng', 123000, '<h2>Đ&acirc;y l&agrave; những c&acirc;u hỏi m&agrave; t&aacute;c giả Trần Do&atilde;n Hưng được nhận h&agrave;ng ng&agrave;y tr&ecirc;n trang c&aacute; nh&acirc;n. Từ năm 2014, khi chị bắt đầu chia sẻ tr&ecirc;n Facebook về c&aacute;c phương ph&aacute;p tự chăm s&oacute;c sức khỏe v&agrave; thải độc định kỳ, nhiều người đ&atilde; l&agrave;m theo v&agrave; đạt được kết quả như: kiểm so&aacute;t ho&agrave;n to&agrave;n c&aacute;c căn bệnh mạn t&iacute;nh, sống khỏe, sống vui.</h2>\n<h2>V&agrave; c&acirc;u hỏi m&agrave; t&aacute;c giả Trần B&iacute;ch H&agrave; lu&ocirc;n trăn trở đ&oacute; l&agrave;: Vậy th&igrave; tại sao vẫn &iacute;t người khỏe v&agrave; tr&agrave;n đầy năng lượng được như m&igrave;nh?</h2>\n<h2>Rồi sau đ&oacute;, chị đ&atilde; t&igrave;m ra được sự thật rằng ho&aacute; ra mọi người ăn thiếu lượng (tức l&agrave; thiếu calo) trầm trọng. Mấy năm vừa rồi, nhiều người bắt đầu thải độc, c&oacute; chế độ ăn kh&aacute; đa dạng, nhưng vẫn bị ảnh hưởng của xu thế thời đại từ T&acirc;y tr&agrave;n về: ăn &iacute;t mới khỏe mạnh, ăn nhiều g&acirc;y b&eacute;o ph&igrave;. Nhưng kh&ocirc;ng hiểu rằng, người phương T&acirc;y trước đ&acirc;y họ ăn như vũ b&atilde;o, c&ograve;n chế độ ăn của người Việt Nam m&igrave;nh, để ăn cho đủ calo l&agrave; vấn đề cực kỳ h&oacute;c b&uacute;a đấy. V&agrave; chị đ&atilde; l&agrave;m một khảo s&aacute;t nhỏ để mọi&nbsp; người liệt k&ecirc; cụ thể: ăn c&aacute;i g&igrave; từng bữa, v&agrave; bật ngửa lu&ocirc;n. Hầu như kh&ocirc;ng ai ăn đủ 1.000 calo/ng&agrave;y. Chả tr&aacute;ch nhiều người gầy đ&eacute;t hoặc b&eacute;o ph&igrave;, da th&igrave; trắng xanh, sần s&ugrave;i, t&agrave;n nhang lấm tấm đầy mặt.</h2>\n<h2>Vậy l&agrave; h&agrave;nh tr&igrave;nh chia sẻ về chế độ ăn của chị bắt đầu t&ocirc;i bắt đầu, chị cũng ấp ủ &yacute; định viết một cuốn cẩm nang về đề t&agrave;i dinh dưỡng, với hy vọng mọi người sẽ c&oacute; đủ cơ sở để tin tưởng v&agrave; thực h&agrave;nh một chế độ ăn uống l&agrave;nh mạnh.</h2>', 'c1e2473d6fe54537880098c7a86e51a3.png', 'Chế Độ Dinh Dưỡng Cân Bằng Cho Người Việt', 145000, 55, 15, 5, 0);
INSERT INTO `book` VALUES (58, 'admin', '2023-11-28 00:36:58', 'admin', '2023-11-28 00:36:58', 'Trần Doãn Hưng', 123000, '<p>Tiếp theo chuỗi s&aacute;ch về thực h&agrave;nh bảo vệ sức khỏe bằng c&aacute;c phương ph&aacute;p tự nhi&ecirc;n của t&aacute;c giả Trần B&iacute;ch H&agrave; v&agrave; Việt Healthy, &ldquo;<em><strong>Chế độ ăn giảm c&acirc;n v&agrave; kiểm so&aacute;t tiểu đường</strong></em>&rdquo; sẽ c&ugrave;ng bạn đọc t&igrave;m hướng giải quyết cho hai vấn đề v&ocirc; c&ugrave;ng phổ biến trong cuộc sống ng&agrave;y nay. Cũng như những cuốn trước, cuốn s&aacute;ch n&agrave;y sẽ giới thiệu tới người đọc cơ sở khoa học cơ bản, th&ocirc;ng tin tham khảo chuy&ecirc;n s&acirc;u cũng như những bước thực h&agrave;nh cụ thể của c&aacute;c phương ph&aacute;p kiểm so&aacute;t tiểu đường v&agrave; giảm c&acirc;n. Điểm đặc biệt của n&oacute; l&agrave; phần tr&igrave;nh b&agrave;y tỉ mỉ, ch&acirc;n thực h&agrave;nh tr&igrave;nh thực tế của hai nh&acirc;n vật &ldquo;người thật việc thật&rdquo;: Một người th&agrave;nh c&ocirc;ng trong việc kiểm so&aacute;t t&igrave;nh trạng sức khỏe, bỏ được thuốc tiểu đường; một người giảm được hơn 30kg. Quan trọng hơn cả l&agrave; họ đều duy tr&igrave; được những th&agrave;nh quả n&agrave;y l&acirc;u d&agrave;i. Qua những c&acirc;u chuyện n&agrave;y, chắc chắn người đọc sẽ r&uacute;t ra được c&aacute;ch thức &aacute;p dụng ph&ugrave; hợp với bản th&acirc;n m&igrave;nh.</p>\n<p>Chị Trần B&iacute;ch H&agrave; chia sẻ: &ldquo;Với sức khỏe của bản th&acirc;n v&agrave; cả gia đ&igrave;nh, ta c&oacute; xu hướng giao v&agrave;o tay b&aacute;c sĩ. B&aacute;c sĩ n&oacute;i sao, ta nghe vậy, hậu quả cuối c&ugrave;ng chỉ c&oacute; ta tự g&aacute;nh chịu. Vậy m&agrave; &iacute;t người chịu bỏ c&ocirc;ng ra, d&ugrave; chỉ v&agrave;i th&aacute;ng, để tự t&igrave;m ra quy luật vận h&agrave;nh của cơ thể ch&iacute;nh m&igrave;nh, rồi nắm lấy sức khỏe v&agrave;o tay m&igrave;nh.</p>', 'ba87ef1ffc35434ba7bb8ab56c0ad33b.jpg', 'Chế Độ Ăn Giảm Cân Và Kiểm Soát Tiểu Đường', 145000, 55, 15, 5, 0);
INSERT INTO `book` VALUES (59, NULL, NULL, 'admin', '2023-11-28 00:55:18', 'Lưu Lượng', 142500, '<p><strong>Kh&ocirc;ng đi học sao được? Kh&ocirc;ng đi học th&igrave; con c&oacute; thể l&agrave;m g&igrave; cơ chứ?</strong></p>\n<p>Hiện tượng &ldquo;<strong>trẻ ch&aacute;n học</strong>&rdquo; kh&ocirc;ng phải đặc trưng ri&ecirc;ng của một lứa tuổi, một bộ phận học sinh thuộc tầng lớp x&atilde; hội n&agrave;o đ&oacute;, m&agrave; l&agrave; vấn đề m&agrave; bất kỳ học sinh hay gia đ&igrave;nh n&agrave;o đều c&oacute; thể gặp phải. Những l&yacute; do kh&aacute;c nhau c&oacute; thể g&oacute;p phần v&agrave;o t&igrave;nh trạng n&agrave;y, như &aacute;p lực từ gia đ&igrave;nh v&agrave; nh&agrave; trường, khối lượng c&ocirc;ng việc qu&aacute; lớn, phương ph&aacute;p học kh&ocirc;ng ph&ugrave; hợp, hoặc thiếu sự quan t&acirc;m v&agrave; kh&iacute;ch lệ từ người xung quanh. Ch&iacute;nh v&igrave; sự quan t&acirc;m n&agrave;y m&agrave; ch&uacute;ng ta cần t&igrave;m hiểu c&aacute;c giải ph&aacute;p để gi&uacute;p trẻ em vượt qua t&igrave;nh trạng ch&aacute;n chường v&agrave; trở lại đam m&ecirc; việc học.</p>\n<p>Cuốn s&aacute;ch&nbsp;<strong>9 phương ph&aacute;p gi&uacute;p trẻ say m&ecirc; việc học tập</strong>&nbsp;sẽ l&agrave; những c&acirc;u chuyện c&oacute; thể gi&uacute;p cho mọi đứa trẻ tho&aacute;t khỏi sự mắc kẹt trong mơ hồ t&igrave;m thấy &yacute; nghĩa của việc học đối với bản th&acirc;n v&agrave; đến trường một c&aacute;ch vui vẻ.</p>\n<p>Nội dung s&aacute;ch&nbsp;9 phương ph&aacute;p gi&uacute;p trẻ say m&ecirc; việc học tập</p>\n<p>292 trang s&aacute;ch sẽ t&oacute;m gọn với 3 nội ch&iacute;nh:</p>\n<p>Phần 1: Trẻ ch&aacute;n học &ndash; Vấn đề nhức nhối của x&atilde; hội, gia đ&igrave;nh v&agrave; c&aacute; nh&acirc;n</p>\n<p>Phần 2: Tại sao con t&ocirc;i kh&ocirc;ng muốn đến trường</p>\n<p>Phần 3: L&agrave;m thế n&agrave;o để c&ugrave;ng trẻ đối ph&oacute; với sự ch&aacute;n học</p>', '215bde24ef7946258957cf40f7fe6f8c.jpg', '9 Phương Pháp Giúp Trẻ Say Mê Việc Học Tập', 168000, 60, 15, 3, 0);
INSERT INTO `book` VALUES (60, NULL, NULL, 'admin', '2023-11-28 00:58:30', 'Toyama', 67000, '<p><strong>Cha Mẹ N&ecirc;n Dạy G&igrave; Cho Con C&aacute;i?</strong>, sắt phải r&egrave;n khi c&ograve;n n&oacute;ng - đ&acirc;y kh&ocirc;ng chỉ l&agrave; nguy&ecirc;n tắc trong c&aacute;c xưởng gia c&ocirc;ng sắt m&agrave; c&ograve;n l&agrave; t&ocirc;n chỉ trong việc gi&aacute;o dục, uốn nắn con người.&nbsp;<a href=\"http://bookbuy.vn/sach/sach-giao-khoa-tham-khao\"><strong>Gi&aacute;o dục</strong></a>&nbsp;được tiến h&agrave;nh từ khi trẻ c&agrave;ng nhỏ th&igrave; hiệu quả đạt được c&agrave;ng lớn. Ch&uacute;ng ta vẫn tưởng rằng trẻ sơ sinh kh&ocirc;ng hiểu g&igrave; nhưng ch&uacute;ng lại l&agrave; những thanh sắt n&oacute;ng nhất. Đừng đợi đến khi trẻ đi mẫu gi&aacute;o hay học tiểu học, h&atilde;y gi&aacute;o dục con ngay từ khi con c&ograve;n ngồi trong l&ograve;ng mẹ. Hơn ai hết,&nbsp;<a href=\"http://bookbuy.vn/sach/sach-cho-cha-me\"><strong>cha mẹ</strong></a>&nbsp;ch&iacute;nh l&agrave; người thầy đầu ti&ecirc;n v&agrave; c&oacute; ảnh hưởng lớn nhất đến cuộc đời con.&nbsp;<em>&ldquo;H&atilde;y tạo khoảng c&aacute;ch đủ rộng với những đứa trẻ m&agrave; ch&uacute;ng ta thương y&ecirc;u, để ch&uacute;ng tự l&agrave;m những chuyến lữ h&agrave;nh của cuộc đời m&igrave;nh.&rdquo;</em></p>\n<p>&nbsp;</p>', '7f794bc1f71e46298589f84db8d52c9d.jpg', 'Cha Mẹ Nên Dạy Gì Cho Con Cái?', 79000, 67, 15, 3, 0);
INSERT INTO `book` VALUES (61, NULL, NULL, 'admin', '2023-11-28 01:00:40', 'Ibuka Masaru', 58500, '<p>Chờ đến mẫu gi&aacute;o th&igrave; đ&atilde; muộn l&agrave; cuốn s&aacute;ch b&agrave;n về phương ph&aacute;p gi&aacute;o dục trẻ trong giai đoạn từ 0 đến 3 tuổi của t&aacute;c giả Ibuka Masaru, người s&aacute;ng lập tập đo&agrave;n Sony đồng thời l&agrave; một nh&agrave; nghi&ecirc;n cứu gi&aacute;o dục. Dựa tr&ecirc;n những nghi&ecirc;n cứu về sinh l&yacute; học của n&atilde;o bộ v&agrave; di truyền học, &ocirc;ng đ&atilde; khẳng định sự ph&aacute;t triển về tr&iacute; tuệ v&agrave; năng lực của trẻ được quyết định trong giai đoạn từ 0 đến 3 tuổi, giai đoạn n&agrave;y l&agrave; &ldquo;thời kỳ th&iacute;ch hợp&rdquo; để &ldquo;nu&ocirc;i dạy một đứa trẻ trở n&ecirc;n ngoan ngo&atilde;n, vui vẻ, c&oacute; tr&iacute; tuệ th&ocirc;ng minh v&agrave; khỏe mạnh&rdquo;. Từ đ&oacute;, &ocirc;ng đưa ra những giải ph&aacute;p để gi&uacute;p c&aacute;c bậc cha mẹ tạo ra m&ocirc;i trường để trẻ c&oacute; thể ph&aacute;t huy hết khả năng của m&igrave;nh.</p>\n<p>Sức cuốn h&uacute;t của Chờ đến mẫu gi&aacute;o th&igrave; đ&atilde; muộn kh&ocirc;ng phải l&agrave; những b&agrave;i học gi&aacute;o dục cao si&ecirc;u m&agrave; ở lời nhắn nhủ h&atilde;y khơi dậy tiềm năng của trẻ từ những điều nhỏ nhặt trong cuộc sống bằng t&igrave;nh y&ecirc;u của người l&agrave;m cha mẹ.</p>', '5cf8393d69d44f5a9f9947337244ac9c.png', 'Chờ Đến Mẫu Giáo Thì Đã Muộn', 69000, 56, 15, 3, 0);
INSERT INTO `book` VALUES (62, NULL, NULL, 'admin', '2023-11-28 01:02:21', 'Rashmi', 118000, '<div id=\"input_line_12\"><span id=\"input_part_0\" data-mention=\"V&ecirc;̀ t&aacute;c giả:\">V&ecirc;̀ t&aacute;c giả:</span></div>\n<div id=\"input_line_14\"><span id=\"input_part_0\" data-mention=\"Rashmi Sirdeshpande tiền th&acirc;n l&agrave; một luật sư, sau đ&oacute; c&ocirc; đ&atilde; chuyển sang l&agrave;m t&aacute;c giả viết truyện thiếu nhi. C&ocirc; cũng l&agrave; người y&ecirc;u th&iacute;ch trẻ nhỏ, th&iacute;ch s&aacute;ng tạo v&agrave; biến ch&uacute;ng th&agrave;nh những &yacute; tưởng th&uacute; vị, dễ tiếp cận đối với độc giả nhỏ tuổi. Rashmi viết s&aacute;ch k&egrave;m tranh minh hoạ, khơi dậy tr&iacute; t&ograve; m&ograve; của trẻ em, cũng như những c&acirc;u chuyện hư cấu gi&agrave;u tr&iacute; tưởng tượng.\">Rashmi Sirdeshpande tiền th&acirc;n l&agrave; một luật sư, sau đ&oacute; c&ocirc; đ&atilde; chuyển sang l&agrave;m t&aacute;c giả viết truyện thiếu nhi. C&ocirc; cũng l&agrave; người y&ecirc;u th&iacute;ch trẻ nhỏ, th&iacute;ch s&aacute;ng tạo v&agrave; biến ch&uacute;ng th&agrave;nh những &yacute; tưởng th&uacute; vị, dễ tiếp cận đối với độc giả nhỏ tuổi. Rashmi viết s&aacute;ch k&egrave;m tranh minh hoạ, khơi dậy tr&iacute; t&ograve; m&ograve; của trẻ em, cũng như những c&acirc;u chuyện hư cấu gi&agrave;u tr&iacute; tưởng tượng.</span></div>\n<div id=\"input_line_15\"></div>\n<div id=\"input_line_16\"><span id=\"input_part_0\" data-mention=\"Bố mẹ tham khảo bộ s&aacute;ch của T&aacute;c giả Rashmi về nu&ocirc;i dạy trẻ:\">Bố mẹ tham khảo bộ s&aacute;ch của T&aacute;c giả Rashmi về nu&ocirc;i dạy trẻ:</span></div>\n<div id=\"input_line_18\"><span id=\"input_part_0\" data-mention=\"- Dạy con ph&aacute;t triển tư duy phản biện\">- Dạy con ph&aacute;t triển tư duy phản biện</span></div>\n<div id=\"input_line_20\"><span id=\"input_part_0\" data-mention=\"- Dạy con quản l&yacute; tiền bạc\">- Dạy con quản l&yacute; tiền bạc</span></div>\n<div id=\"input_line_22\"><span id=\"input_part_0\" data-mention=\"- Dạy con quản l&yacute; t&agrave;i ch&iacute;nh th&ocirc;ng minh\">- Dạy con quản l&yacute; t&agrave;i ch&iacute;nh th&ocirc;ng minh</span></div>', '3164226385544674af7781bf518d9015.jpg', 'Dạy Con Quản Lý Tiền Bạc', 139000, 60, 15, 3, 0);
INSERT INTO `book` VALUES (63, 'admin', '2023-11-28 00:46:34', 'admin', '2023-11-28 00:46:35', 'Dook Media', 73000, '<p>Việc r&egrave;n luyện kĩ năng diễn đạt trong giao tiếp cư xử giữa bố mẹ v&agrave; con c&aacute;i ở giai đoạn tiểu học l&agrave; v&ocirc; c&ugrave;ng cần thiết cho sự ph&aacute;t triển l&agrave;nh mạnh v&agrave; x&acirc;y dựng kĩ năng giao tiếp x&atilde; hội của trẻ. Giao tiếp tốt trong gia đ&igrave;nh kh&ocirc;ng chỉ c&oacute; thể cải thiện khả năng giao tiếp chung của trẻ m&agrave; c&ograve;n mang lại sự tự tin, năng lượng t&iacute;ch cực cho con.</p>\n<p><strong>Kĩ Năng X&atilde; Hội Cho Học Sinh Tiểu Học - Cư Xử Trong Gia Đ&igrave;nh</strong>&nbsp;tập trung khắc họa 35 t&igrave;nh&nbsp;huống giao tiếp ứng xử thường gặp trong phạm vi gia đ&igrave;nh v&agrave; người th&acirc;n, được thể hiện dưới dạng truyện tranh, xen kẽ đ&oacute; l&agrave; những gợi &yacute; c&aacute;ch giải quyết đơn giản, dễ hiểu. Cuốn s&aacute;ch g&oacute;p phần gi&uacute;p trẻ cải thiện khả năng diễn đạt hoặc r&egrave;n luyện giao tiếp trong gia đ&igrave;nh khi tr&ograve; chuyện với bố mẹ, &ocirc;ng b&agrave; v&agrave; những người th&acirc;n kh&aacute;c; giao tiếp tốt trong gia đ&igrave;nh l&agrave; bước đầu quan trọng để tạo tiền đề thiết lập kĩ năng giao tiếp x&atilde; hội tốt đẹp.<br>------<br>Trung t&acirc;m Nghi&ecirc;n cứu T&acirc;m l&iacute; trẻ em gồm một nh&oacute;m những gi&aacute;o vi&ecirc;n xuất sắc, chuy&ecirc;n gia sư phạm, những người c&oacute; kinh nghiệm l&agrave;m việc trong lĩnh vực gi&aacute;o dục.</p>\n<p><br>QUỐC DOANH<br>Tiến sĩ gi&aacute;o dục, Đại học Sư phạm Bắc Kinh, học giả tại Đại học California, Hoa K&igrave;. Thầy gi&aacute;o m&ocirc;n gi&aacute;o dục tr&iacute; tuệ, cảm x&uacute;c gia đ&igrave;nh, c&aacute;c vấn đề li&ecirc;n quan đến kiến thức cuộc sống.</p>\n<p><br>DƯƠNG CHI YẾN<br>Tiến sĩ gi&aacute;o dục, Đại học Sư phạm Hoa Đ&ocirc;ng. Đ&atilde; tham gia v&agrave;o một số dự &aacute;n cấp quốc gia như: Hướng dẫn trẻ em học tập v&agrave; ph&aacute;t triển, t&aacute;c động của bố mẹ tới học h&agrave;nh của con, nghi&ecirc;n cứu gi&aacute;o dục, ph&aacute;t triển nhận thức của trẻ.<br>&nbsp;</p>\n<p>TRƯƠNG HUỆ THANH</p>\n<p>Ph&oacute; gi&aacute;o sư khoa Gi&aacute;o dục, Đại học D&acirc;n tộc T&acirc;y Tạng. &Ocirc;ng gắn b&oacute; với ng&agrave;nh gi&aacute;o dục gần 20 năm, nghi&ecirc;n cứu v&agrave; thực h&agrave;nh gi&aacute;o dục trẻ em trong một thời gian d&agrave;i. Gi&uacute;p trẻ em ph&aacute;t triển, n&acirc;ng cao chất lượng to&agrave;n diện trong thời đại số hiện nay.</p>\n<p><br>C&ugrave;ng t&igrave;m đọc bộ s&aacute;ch Kĩ Năng X&atilde; Hội Cho Học Sinh Tiểu Học với c&aacute;c chủ đề:<br>- Giao Tiếp Hiệu Quả<br>- Học C&aacute;ch Tự Tin<br>- Kiểm So&aacute;t Cảm X&uacute;c<br>- Tư Duy T&iacute;ch Cực<br>- Tự Gi&aacute;c V&agrave; Tự Lập<br>- H&agrave;i Hước V&agrave; Lạc Quan<br>- Ứng Xử Ngo&agrave;i X&atilde; Hội<br>- Cư Xử Trong Gia Đ&igrave;nh<br>- Giao Tiếp Nơi Học Đường</p>', '9b3b772a0a5448acb5011731c0bb4aad.jpg', 'Kĩ Năng Xã Hội Cho Học Sinh Tiểu Học - Cư Xử Trong Gia Đình', 86000, 55, 15, 4, 0);
