INSERT INTO `book` VALUES (65, NULL, NULL, 'admin', '2023-11-28 01:09:22', 'Dook Media', 73000, '<p>Việc r&egrave;n luyện kĩ năng diễn đạt trong giao tiếp cư xử giữa bố mẹ v&agrave; con c&aacute;i ở giai đoạn tiểu học l&agrave; v&ocirc; c&ugrave;ng cần thiết cho sự ph&aacute;t triển l&agrave;nh mạnh v&agrave; x&acirc;y dựng kĩ năng giao tiếp x&atilde; hội của trẻ. Giao tiếp tốt trong gia đ&igrave;nh kh&ocirc;ng chỉ c&oacute; thể cải thiện khả năng giao tiếp chung của trẻ m&agrave; c&ograve;n mang lại sự tự tin, năng lượng t&iacute;ch cực cho con.</p>\n<p><strong>Kĩ Năng X&atilde; Hội Cho Học Sinh Tiểu Học - Cư Xử Trong Gia Đ&igrave;nh</strong>&nbsp;tập trung khắc họa 35 t&igrave;nh&nbsp;huống giao tiếp ứng xử thường gặp trong phạm vi gia đ&igrave;nh v&agrave; người th&acirc;n, được thể hiện dưới dạng truyện tranh, xen kẽ đ&oacute; l&agrave; những gợi &yacute; c&aacute;ch giải quyết đơn giản, dễ hiểu. Cuốn s&aacute;ch g&oacute;p phần gi&uacute;p trẻ cải thiện khả năng diễn đạt hoặc r&egrave;n luyện giao tiếp trong gia đ&igrave;nh khi tr&ograve; chuyện với bố mẹ, &ocirc;ng b&agrave; v&agrave; những người th&acirc;n kh&aacute;c; giao tiếp tốt trong gia đ&igrave;nh l&agrave; bước đầu quan trọng để tạo tiền đề thiết lập kĩ năng giao tiếp x&atilde; hội tốt đẹp.<br>------<br>Trung t&acirc;m Nghi&ecirc;n cứu T&acirc;m l&iacute; trẻ em gồm một nh&oacute;m những gi&aacute;o vi&ecirc;n xuất sắc, chuy&ecirc;n gia sư phạm, những người c&oacute; kinh nghiệm l&agrave;m việc trong lĩnh vực gi&aacute;o dục.</p>\n<p><br>QUỐC DOANH<br>Tiến sĩ gi&aacute;o dục, Đại học Sư phạm Bắc Kinh, học giả tại Đại học California, Hoa K&igrave;. Thầy gi&aacute;o m&ocirc;n gi&aacute;o dục tr&iacute; tuệ, cảm x&uacute;c gia đ&igrave;nh, c&aacute;c vấn đề li&ecirc;n quan đến kiến thức cuộc sống.</p>\n<p><br>DƯƠNG CHI YẾN<br>Tiến sĩ gi&aacute;o dục, Đại học Sư phạm Hoa Đ&ocirc;ng. Đ&atilde; tham gia v&agrave;o một số dự &aacute;n cấp quốc gia như: Hướng dẫn trẻ em học tập v&agrave; ph&aacute;t triển, t&aacute;c động của bố mẹ tới học h&agrave;nh của con, nghi&ecirc;n cứu gi&aacute;o dục, ph&aacute;t triển nhận thức của trẻ.<br>&nbsp;</p>\n<p>TRƯƠNG HUỆ THANH</p>\n<p>Ph&oacute; gi&aacute;o sư khoa Gi&aacute;o dục, Đại học D&acirc;n tộc T&acirc;y Tạng. &Ocirc;ng gắn b&oacute; với ng&agrave;nh gi&aacute;o dục gần 20 năm, nghi&ecirc;n cứu v&agrave; thực h&agrave;nh gi&aacute;o dục trẻ em trong một thời gian d&agrave;i. Gi&uacute;p trẻ em ph&aacute;t triển, n&acirc;ng cao chất lượng to&agrave;n diện trong thời đại số hiện nay.</p>\n<p><br>C&ugrave;ng t&igrave;m đọc bộ s&aacute;ch Kĩ Năng X&atilde; Hội Cho Học Sinh Tiểu Học với c&aacute;c chủ đề:<br>- Giao Tiếp Hiệu Quả<br>- Học C&aacute;ch Tự Tin<br>- Kiểm So&aacute;t Cảm X&uacute;c<br>- Tư Duy T&iacute;ch Cực<br>- Tự Gi&aacute;c V&agrave; Tự Lập<br>- H&agrave;i Hước V&agrave; Lạc Quan<br>- Ứng Xử Ngo&agrave;i X&atilde; Hội<br>- Cư Xử Trong Gia Đ&igrave;nh<br>- Giao Tiếp Nơi Học Đường</p>', 'fec386e7186e4dd3992331d0a408c60a.jpg', 'Kĩ Năng Xã Hội Cho Học Sinh Tiểu Học - Hài Hước Và Lạc Quan', 86000, 55, 15, 4, 0);
