h&aacute;t triển, t&aacute;c động của bố mẹ tới học h&agrave;nh của con, nghi&ecirc;n cứu gi&aacute;o dục, ph&aacute;t triển nhận thức của trẻ.<br>&nbsp;</p>\n<p>TRƯƠNG HUỆ THANH</p>\n<p>Ph&oacute; gi&aacute;o sư khoa Gi&aacute;o dục, Đại học D&acirc;n tộc T&acirc;y Tạng. &Ocirc;ng gắn b&oacute; với ng&agrave;nh gi&aacute;o dục gần 20 năm, nghi&ecirc;n cứu v&agrave; thực h&agrave;nh gi&aacute;o dục trẻ em trong một thời gian d&agrave;i. Gi&uacute;p trẻ em ph&aacute;t triển, n&acirc;ng cao chất lượng to&agrave;n diện trong thời đại số hiện nay.</p>\n<p><br>C&ugrave;ng t&igrave;m đọc bộ s&aacute;ch Kĩ Năng X&atilde; Hội Cho Học Sinh Tiểu Học với c&aacute;c chủ đề:<br>- Giao Tiếp Hiệu Quả<br>- Học C&aacute;ch Tự Tin<br>- Kiểm So&aacute;t Cảm X&uacute;c<br>- Tư Duy T&iacute;ch Cực<br>- Tự Gi&aacute;c V&agrave; Tự Lập<br>- H&agrave;i Hước V&agrave; Lạc Quan<br>- Ứng Xử Ngo&agrave;i X&atilde; Hội<br>- Cư Xử Trong Gia Đ&igrave;nh<br>- Giao Tiếp Nơi Học Đường</p>', 'a7c1d976fa7a4773b3072c582448e7ed.jpg', 'Kĩ Năng Xã Hội Cho Học Sinh Tiểu Học - Tư Duy Tích Cực', 86000, 55, 15, 4, 0);
INSERT INTO `book` VALUES (67, 'admin', '2023-11-28 00:49:47', 'admin', '2023-11-28 00:49:47', 'Dook Media', 73000, '<p>Bước v&agrave;o bậc tiểu học, tuy &yacute; thức tự lập đ&atilde; manh nha xuất hiện ở trẻ, nhưng &yacute; thức tự gi&aacute;c vẫn c&ograve;n rất non nớt. Nhiều bạn nhỏ thiếu kĩ năng tự chủ v&agrave; tự quản l&iacute; bản th&acirc;n, n&ecirc;n c&oacute; nhiều th&oacute;i quen, h&agrave;nh vi chưa tốt, đơn cử như ch&acirc;y lười, chưa biết chấp h&agrave;nh, tu&acirc;n thủ nguy&ecirc;n tắc v&agrave; kỉ luật. Nếu kh&ocirc;ng uốn nắn những h&agrave;nh vi chưa tốt ngay từ đầu, trẻ dễ h&igrave;nh th&agrave;nh th&oacute;i quen xấu, ảnh hưởng lớn đến qu&aacute; tr&igrave;nh trưởng th&agrave;nh về sau. Nhưng uốn nắn thế n&agrave;o cho đ&uacute;ng v&agrave; đủ tế nhị để trẻ kh&ocirc;ng chống đối, nổi loạn, g&acirc;y t&aacute;c động xấu đến việc học v&agrave; lối sống của trẻ?</p>\n<p><em><strong>Tự Gi&aacute;c V&agrave; Tự Lập</strong></em> cung cấp những những phương ph&aacute;p v&agrave; b&agrave;i tập r&egrave;n luyện dễ hiểu v&agrave; tiếp thu, gi&uacute;p trẻ dần h&igrave;nh th&agrave;nh &yacute; thức v&agrave; th&oacute;i quen t&iacute;ch cựcc trong học tập v&agrave; cuộc sống, trở th&agrave;nh một người c&oacute; năng lực tự gi&aacute;c v&agrave; tự lập. Cuốn s&aacute;ch được chia th&agrave;nh 4 chương, với 38 t&igrave;nh huống v&agrave; b&agrave;i tập kĩ năng. C&aacute;c t&igrave;nh huống v&agrave; b&agrave;i tập thực h&agrave;nh trong s&aacute;ch c&oacute; thể coi l&agrave; một kh&oacute;a đ&agrave;o tạo kĩ năng b&agrave;i bản, c&oacute; hệ thống, gi&uacute;p trẻ nắm bắt đầy đủ kĩ năng sống thiết yếu về tự gi&aacute;c v&agrave; tự lập.</p>', 'ba518e5ed60c4283957cfee9dd195966.jpg', 'Kĩ Năng Xã Hội Cho Học Sinh Tiểu Học - Tự Giác Và Tự Lập', 86000, 55, 15, 4, 0);
INSERT INTO `book` VALUES (68, 'admin', '2023-11-28 01:06:43', 'admin', '2023-11-28 01:06:43', 'Lê Tất Điều', 120500, '<p>Những đứa trẻ m&ugrave; do nghịch cảnh đưa đẩy, đ&atilde; gặp gỡ nhau trong một trường khiếm thị chật chội, thiếu thốn. Ch&uacute;ng m&ograve; mẫm nhận ra nhau, chấp nhận nhau, t&igrave;m kiếm v&agrave; nương nhờ t&igrave;nh th&acirc;n để tự chữa l&agrave;nh, rồi biết c&aacute;ch đem tr&aacute;i tim thổn thức, giai điệu y&ecirc;u thương đến cho cuộc đời.</p>\n<p>B&oacute;ng đ&ecirc;m t&agrave;n khốc của cuộc chiến, những tổn thương nghiệt ng&atilde; của đời ri&ecirc;ng đ&atilde; được xua tan tr&ecirc;n trang văn L&ecirc; Tất Điều bằng một lối văn tinh tế, nhẹ nh&agrave;ng v&agrave; đầy x&uacute;c động.</p>\n<p>Nếu phải t&igrave;m kiếm cho độc giả nhỏ tuổi h&ocirc;m nay một t&aacute;c phẩm văn chương nu&ocirc;i dưỡng l&ograve;ng nh&acirc;n &aacute;i, tinh thần bao dung, th&igrave;&nbsp;<em><strong>Đ&ecirc;m d&agrave;i một đời</strong></em> l&agrave; một chọn lựa ho&agrave;n hảo.</p>', '72009e056f624f2aa1bc9bb9526751bc.jpg', 'Đêm Dài Một Đời', 142000, 50, 15, 2, 0);
INSERT INTO `book` VALUES (69, NULL, NULL, 'admin', '2023-11-28 01:13:39', 'Na Gyeo UI', 81500, '<div id=\"input_line_31\"><span id=\"input_part_0\" data-mention=\"Mỗi ch&uacute;ng ta ai cũng từng trăn trở tại sao lại kh&oacute; y&ecirc;u thương ch&iacute;nh m&igrave;nh đến vậy. Nhưng thời gian sẽ khiến bạn nhận ra đ&acirc;y l&agrave; việc kh&ocirc;ng ai c&oacute; thể l&agrave;m thay ngo&agrave;i bản th&acirc;n m&igrave;nh.\">Mỗi ch&uacute;ng ta ai cũng từng trăn trở tại sao lại kh&oacute; y&ecirc;u thương ch&iacute;nh m&igrave;nh đến vậy. Nhưng thời gian sẽ khiến bạn nhận ra đ&acirc;y l&agrave; việc kh&ocirc;ng ai c&oacute; thể l&agrave;m thay ngo&agrave;i bản th&acirc;n m&igrave;nh.</span></div>\n<div id=\"input_line_32\"></div>\n<div id=\"input_line_33\"><span id=\"input_part_0\" data-mention=\"Y&ecirc;u thương bản th&acirc;n kỳ thực chỉ đơn giản l&agrave; quan t&acirc;m đến cuộc đời của m&igrave;nh. B&ecirc;n cạnh sức khỏe thể chất, ch&uacute;ng ta cũng cần chăm lo cho t&acirc;m trạng mọi l&uacute;c mọi nơi. Tận hưởng trọn vẹn niềm vui l&agrave; một điều tuyệt vời nhưng những cảm x&uacute;c xấu kh&ocirc;ng đồng nghĩa với việc bạn đang gặp điều tồi tệ. H&atilde;y nh&igrave;n nhận đ&uacute;ng về bản chất của cảm x&uacute;c để c&oacute; thể thấu hiểu v&agrave; tr&acirc;n trọng con người thật của bạn. Điều ấy c&oacute; thể kh&oacute; khăn nhưng đừng qu&ecirc;n rằng đ&oacute; mới l&agrave; con đường dẫn bạn đến hạnh ph&uacute;c.\">Y&ecirc;u thương bản th&acirc;n kỳ thực chỉ đơn giản l&agrave; quan t&acirc;m đến cuộc đời của m&igrave;nh. B&ecirc;n cạnh sức khỏe thể chất, ch&uacute;ng ta cũng cần chăm lo cho t&acirc;m trạng mọi l&uacute;c mọi nơi. Tận hưởng trọn vẹn niềm vui l&agrave; một điều tuyệt vời nhưng những cảm x&uacute;c xấu kh&ocirc;ng đồng nghĩa với việc bạn đang gặp điều tồi tệ. H&atilde;y nh&igrave;n nhận đ&uacute;ng về bản chất của cảm x&uacute;c để c&oacute; thể thấu hiểu v&agrave; tr&acirc;n trọng con người thật của bạn. Điều ấy c&oacute; thể kh&oacute; khăn nhưng đừng qu&ecirc;n rằng đ&oacute; mới l&agrave; con đường dẫn bạn đến hạnh ph&uacute;c.</span></div>\n<div id=\"input_line_34\"></div>\n<div><img src=\"https://bookbuy.vn/kcfinder/upload/files/mockup_3d_-_ng_t_m_tr_ng_tr_th_nh_th_i_%281%29.png\" alt=\"\"></div>\n<div><br><span id=\"input_part_0\" data-mention=\"&ldquo;Đừng để t&acirc;m trạng trở th&agrave;nh th&aacute;i độ&rdquo; l&agrave; lời nhắn nhủ ch&acirc;n t&igrave;nh đến những ai đang vật lộn tr&ecirc;n h&agrave;nh tr&igrave;nh y&ecirc;u thương, gi&uacute;p bạn hiểu rằng tất cả hỉ nộ ai lạc l&agrave; những hoa ti&ecirc;u dẫn đến c&aacute;c ng&atilde; rẽ mới trong cuộc đời.\">&ldquo;Đừng để t&acirc;m trạng trở th&agrave;nh th&aacute;i độ&rdquo; l&agrave; lời nhắn nhủ ch&acirc;n t&igrave;nh đến những ai đang vật lộn tr&ecirc;n h&agrave;nh tr&igrave;nh y&ecirc;u thương, gi&uacute;p bạn hiểu rằng tất cả hỉ nộ ai lạc l&agrave; những hoa ti&ecirc;u dẫn đến c&aacute;c ng&atilde; rẽ mới trong cuộc đời.</span></div>\n<div id=\"input_line_36\"></div>\n<div id=\"input_line_37\"><span id=\"input_part_0\" data-mention=\"B&ecirc;n cạnh những l&yacute; giải s&acirc;u sắc về cảm x&uacute;c, cuốn s&aacute;ch c&ograve;n cung cấp &ldquo;10 Liệu ph&aacute;p t&acirc;m l&yacute; bằng chữ&rdquo; gi&uacute;p bạn c&oacute; th&ecirc;m kỹ năng thấu hiểu v&agrave; thay đổi bản th&acirc;n. Ngo&agrave;i ra, bạn cũng kh&ocirc;ng thể bỏ qua phần phụ lục &ldquo;Nhật k&yacute; t&acirc;m trạng&rdquo; - một bản đ&aacute;nh gi&aacute; t&igrave;nh y&ecirc;u thương đối với ch&iacute;nh m&igrave;nh được thiết kế khoa học v&agrave; xinh xắn ở phần cuối cuốn s&aacute;ch.\">B&ecirc;n cạnh những l&yacute; giải s&acirc;u sắc về cảm x&uacute;c, cuốn s&aacute;ch c&ograve;n cung cấp &ldquo;10 Liệu ph&aacute;p t&acirc;m l&yacute; bằng chữ&rdquo; gi&uacute;p bạn c&oacute; th&ecirc;m kỹ năng thấu hiểu v&agrave; thay đổi bản th&acirc;n. Ngo&agrave;i ra, bạn cũng kh&ocirc;ng thể bỏ qua phần phụ lục &ldquo;Nhật k&yacute; t&acirc;m trạng&rdquo; - một bản đ&aacute;nh gi&aacute; t&igrave;nh y&ecirc;u thương đối với ch&iacute;nh m&igrave;nh được thiết kế khoa học v&agrave; xinh xắn ở phần cuối cuốn s&aacute;ch.</span></div>\n<div id=\"input_line_38\"></div>\n<div id=\"input_line_39\"><span id=\"input_part_0\" data-mention=\"Tất cả những nỗ lực bạn bỏ ra sẽ hồi đ&aacute;p cho bạn một th&agrave;nh quả xứng đ&aacute;ng.\">Tất cả những nỗ lực bạn bỏ ra sẽ hồi đ&aacute;p cho bạn một th&agrave;nh quả xứng đ&aacute;ng.</span></div>\n<div id=\"input_line_40\"></div>\n<div id=\"input_line_41\"><span id=\"input_part_0\" data-mention=\"H&atilde;y chăm s&oacute;c cơ thể v&agrave; t&acirc;m tr&iacute; của bạn nhiều nhất c&oacute; thể nh&eacute;.\">H&atilde;y chăm s&oacute;c cơ thể v&agrave; t&acirc;m tr&iacute; của bạn nhiều nhất c&oacute; thể nh&eacute;.</span></div>\n<div id=\"input_line_42\"></div>\n<div id=\"input_line_43\"><span id=\"input_part_0\" data-mention=\"Đ&oacute; ch&iacute;nh l&agrave; c&aacute;ch để y&ecirc;u bản th&acirc;n m&igrave;nh đấy!\">Đ&oacute; ch&iacute;nh l&agrave; c&aacute;ch để y&ecirc;u bản th&acirc;n m&igrave;nh đấy!</span></div>', '673513a6d3024c46949d06ffefc127e8.jpg', 'Đừng Để Tâm Trạng Trở Thành Thái Độ', 96000, 70, 15, 2, 0);
INSERT INTO `book` VALUES (70, 'admin', '2023-11-28 01:18:12', 'admin', '2023-11-28 23:01:56', 'Lập Thệ Thành Yêu', 123000, '<p>Sau khi mất cả cha lẫn mẹ, Hoa Th&aacute;i U được Ti&ecirc;u B&aacute;i nhận nu&ocirc;i. Ti&ecirc;u B&aacute;i l&agrave; huynh đệ kết nghĩa với cha n&agrave;ng, khi xưa hai người từng thề với nhau nếu một người sinh con trai, một người sinh con g&aacute;i th&igrave; sẽ cho ch&uacute;ng l&agrave;m phu th&ecirc;. Thế l&agrave;, n&agrave;ng đ&atilde; trở th&agrave;nh con d&acirc;u tương lai của Ti&ecirc;u gia.&nbsp;</p>\n<p>Phu qu&acirc;n tương lai của n&agrave;ng l&agrave; Ti&ecirc;u Mặc Dự, từ b&eacute; cậu đ&atilde; l&agrave; thần đồng, cậu th&iacute;ch ng&acirc;m thơ, l&agrave;m c&acirc;u đối, luyện chữ..., to&agrave;n th&acirc;n to&aacute;t l&ecirc;n vẻ nho nh&atilde;, phong trần. C&ograve;n Hoa Th&aacute;i U lại h&agrave;o sảng kho&aacute;ng đạt, c&oacute; ch&uacute;t lỗ m&atilde;ng, v&igrave; vậy ngay từ ng&agrave;y đầu ti&ecirc;n gặp mặt, họ đ&atilde; trở th&agrave;nh oan gia.&nbsp;</p>\n<p>&nbsp;</p>\n<p>Một ng&agrave;y kia, sau khi đi xa nửa năm, Ti&ecirc;u Mặc Dự đưa một biểu muội xa kh&ocirc;ng nơi nương tựa về ở, người biểu muội đ&oacute; v&ocirc; c&ugrave;ng t&acirc;m đầu &yacute; hợp với Ti&ecirc;u Mặc Dự. Kh&ocirc;ng l&acirc;u sau đ&oacute;, tranh thủ l&uacute;c Ti&ecirc;u Mặc Dự đi vắng, Hoa Th&aacute;i U quyết định bỏ đi, chỉ để lại &ldquo;giấy ly h&ocirc;n&rdquo;tr&ecirc;n b&agrave;n.&nbsp;</p>\n<p>N&agrave;ng một th&acirc;n một m&igrave;nh đến Ung Th&agrave;nh, mua lại Ti&ecirc;u Kim Lầu, ngang nhi&ecirc;n trở th&agrave;nh t&uacute; b&agrave; nổi tiếng nhất v&ugrave;ng! Tưởng chừng cuộc đời n&agrave;ng từ đ&acirc;y kh&ocirc;ng c&ograve;n li&ecirc;n quan g&igrave; đến c&aacute;i t&ecirc;n họ Ti&ecirc;u kia nữa th&igrave; hai người lại t&igrave;nh cờ gặp lại nhau tại thanh l&acirc;u của n&agrave;ng. Liệu đ&ocirc;i oan gia n&agrave;y sẽ ra sao?</p>', '22589f9d666041229efb16262ebb374f.jpg', 'Du Thái Hoa', 145000, 43, 15, 2, 0);
INSERT INTO `book` VALUES (71, 'admin', '2023-11-28 01:20:15', 'admin', '2023-11-28 23:01:56', 'Francesca Zappia', 109000, '<p><em>Cuốn s&aacute;ch đầu tay đưa nh&agrave; văn Francesca Zappia lọt top những nh&agrave; văn trẻ được y&ecirc;u th&iacute;ch nhất năm 2015 tại Mỹ v&agrave; nhiều nước Ch&acirc;u &Acirc;u.</em></p>\n<p>&nbsp;</p>\n<p><strong>MADE YOU UP</strong>&nbsp;kể về c&acirc;u chuyện của c&ocirc; n&agrave;ng Alex, với m&aacute;i t&oacute;c t&oacute;c đỏ rực, lu&ocirc;n k&egrave; k&egrave; m&aacute;y ảnh mọi l&uacute;c mọi nơi, v&agrave;o năm học cuối phải chuyển từ trường trung học Hillpark tới East Shoal. V&igrave; một sự cố vẽ tranh l&ecirc;n tường m&agrave; Alex bị đuổi khỏi trường cũ của m&igrave;nh.&nbsp;</p>\n<p>&nbsp;</p>\n<p><em>\"Nhưng... Bạn c&oacute; tin v&agrave;o thứ m&agrave; chỉ m&igrave;nh bạn nh&igrave;n thấy, c&ograve;n người kh&aacute;c th&igrave; kh&ocirc;ng?\"</em>&nbsp; &nbsp;</p>\n<p>&nbsp; &nbsp;</p>\n<p>H&agrave;ng ng&agrave;y, Alex phải đ&acirc;u tranh tư tưởng để ph&acirc;n biệt được hiện thực v&agrave; ảo gi&aacute;c. Đ&uacute;ng vậy, c&ocirc; mắc chứng hoang tưởng. Alex lu&ocirc;n phải kiểm tra khu vực xung quanh m&igrave;nh bằng c&aacute;ch chụp ảnh ch&uacute;ng, v&igrave; c&ocirc; kh&ocirc;ng tin v&agrave;o mắt m&igrave;nh, v&agrave;o những g&igrave; bản th&acirc;n m&igrave;nh nghĩ. Cho đến một ng&agrave;y kia c&ocirc; c&ocirc; t&igrave;nh bắt gặp cậu bạn &ldquo;Mắt xanh&rdquo; Miles tại bể t&ocirc;m h&ugrave;m.</p>\n<p>&nbsp;</p>\n<p><em>&ldquo;V&agrave;o ng&agrave;y đặc biệt đ&oacute;, mọi thứ tr&ecirc;n thế giới trở n&ecirc;n tốt đẹp. Kh&ocirc;ng quan trọng nếu mọi thứ tr&ecirc;n thực tế kh&ocirc;ng ho&agrave;n to&agrave;n tốt đẹp. Đ&oacute; l&agrave; thời điểm duy nhất trong năm m&agrave; chỉ cần giả vờ l&agrave; đủ.&rdquo;</em></p>\n<p>&nbsp;</p>\n<p>Bạn c&oacute; tin v&agrave;o t&igrave;nh y&ecirc;u từ c&aacute;i nh&igrave;n đầu ti&ecirc;n kh&ocirc;ng? Nếu c&oacute; th&igrave; bạn đ&atilde; sai rồi, Miles kh&ocirc;ng phải l&agrave; một cậu bạn khiến bạn y&ecirc;u ngay đ&acirc;u. Hồi đầu, &ldquo;Mắt xanh&rdquo; l&agrave; một cậu bạn t&agrave;i giỏi nhưng hay bị mọi người tr&ecirc;u chọc v&agrave; xa l&aacute;nh v&igrave; chất giọng đặc người Đức của cậu. Dần dần cậu tiến đến, mở rộng c&aacute;nh cửa bước v&agrave;o thế giới mơ mơ hồ hồ của Alex. Alex v&agrave; Miles trở th&agrave;nh một cặp. Họ c&ugrave;ng nhau vượt qua những kh&oacute; khăn của tuổi học tr&ograve;.&nbsp;</p>\n<p>&nbsp;</p>\n<p>Một cuốn s&aacute;ch đ&aacute;nh động c&ocirc; b&eacute; 18 tuổi năm n&agrave;o trong l&ograve;ng bạn, một c&acirc;u chuyện khiến bạn nhớ đến những người bạn trung học b&igrave;nh thường nhưng cũng c&oacute; l&uacute;c bất thường. Những giai đoạn bạn thấy ch&aacute;n gh&eacute;t nhưng sau n&agrave;y nh&igrave;n lại, đ&oacute; l&agrave; khoảng thời gian bạn sẵn s&agrave;ng đ&aacute;nh đổi tất cả chỉ đẻ trải nghiệm lại n&oacute; một ng&agrave;y.</p>\n<p>&nbsp;</p>\n<p><em>&ldquo;Ch&uacute;ng ta chỉ l&agrave; con người, v&agrave; con người đ&ocirc;i khi l&agrave;m những chuyện ngu ngốc.&rdquo;&nbsp;</em></p>\n<p>&nbsp;</p>\n<p>Cuộc đời ch&uacute;ng ta phải trải qua nhiều ng&atilde; rẽ, nhưng n&oacute; chỉ đơn giản l&agrave; ng&atilde; rẽ th&ocirc;i c&ograve;n lại phụ thuộc v&agrave;o bạn chứ? T&ocirc;i c&oacute; thể kh&aacute;c biệt, c&oacute; thể kh&ocirc;ng giống người kh&aacute;c nhưng h&atilde;y để t&ocirc;i l&agrave;m &ldquo;nh&acirc;n vật ch&iacute;nh&rdquo; trong c&acirc;u chuyện cuộc đời của ri&ecirc;ng t&ocirc;i.</p>', 'f0961a803e40441592c812fb31413153.jpg', 'Made You Up', 129000, 54, 15, 2, 0);
INSERT INTO `book` VALUES (72, 'admin', '2023-11-28 01:31:49', 'admin', '2023-11-28 23:01:55', 'Lê Tuyết Trinh', 36500, '<p>&ldquo;H&atilde;y đặt tay l&ecirc;n ngực, cậu sẽ cảm nhận được tiếng n&oacute;i của tr&aacute;i tim. Đ&oacute; l&agrave; nơi khiến cậu thấy y&ecirc;u bố, l&agrave; nơi tạo n&ecirc;n những nhớ thương của cậu. &Yacute; tớ l&agrave;, tr&aacute;i tim đem đến những niềm hạnh ph&uacute;c nhỏ b&eacute; đầy &yacute; nghĩa. Khi cậu đọc một cuốn s&aacute;ch v&agrave; nghĩ về n&oacute; mỗi ng&agrave;y, hay khi cậu lắng nghe tiếng chim h&oacute;t, tiếng suối chảy r&oacute;c r&aacute;ch len lỏi qua khe đ&aacute;, cậu sẽ thấy thế giới thật diệu k&igrave;, v&agrave; cậu thức giấc mỗi s&aacute;ng trong sự h&aacute;o hức rộn r&agrave;ng, tất cả đều nhờ tr&aacute;i tim, cậu b&eacute; ạ.&rdquo;</p>\n<p>&nbsp;</p>\n<p><em><strong>Tr&ecirc;n mặt đất, qua bầu trời</strong></em>&nbsp;mang đến những x&uacute;c cảm thuần khiết của tuổi thơ, đan xen c&ugrave;ng kiến thức tự nhi&ecirc;n th&uacute; vị. Giọng văn nhẹ nh&agrave;ng đ&aacute;ng y&ecirc;u, cốt truyện đầy ắp tưởng tượng c&ugrave;ng nhiều t&igrave;nh huống bất ngờ sẽ gi&uacute;p c&aacute;c bạn đọc nhỏ tuổi bồi đắp t&igrave;nh y&ecirc;u thi&ecirc;n nhi&ecirc;n v&agrave; &yacute; thức bảo vệ m&ocirc;i trường.</p>\n<p>Kiến thức về tự nhi&ecirc;n lồng trong c&aacute;c c&acirc;u chuyện kể hấp dẫn gi&uacute;p bạn đọc nhỏ tuổi mở mang v&agrave; học hỏi một c&aacute;ch chủ động, th&iacute;ch th&uacute;.</p>\n<p>T&aacute;c giả L&ecirc; Tuyết Trinh sinh năm 1999, hiện đang sống v&agrave; l&agrave;m việc ở H&agrave; Nội.</p>', '606c0c8b5c4d4f0c8b0c5eac76f09abe.jpg', 'Trên Mặt Đất, Qua Bầu Trời: Xây Dựng Cho Trẻ Tình Yêu Thiên Nhiên Và Ý Thức Bảo Vệ Môi Trường', 43000, 74, 15, 4, 0);
